INSERT INTO `events` VALUES (1,'متلب','محاسبه‌ی ایده‌ها، با ماتریس‌ها','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','به جرأت می‌توان گفت که متلب، مهمترین نرم افزار در پژوهش‌های علمی و شبیه‌سازی‌های پیشرفته بخصوص در رشته‌های فنی مهندسی به شمار می‌رود. کاربرد این نرم‌افزار به قدری گسترده است که از محاسبات ساده‌ی ریاضی گرفته تا پیاده‌سازی الگوریتم‌های مختلف و پردازش سیگنال‌ها و تصاویر بسیار پیچیده را شامل می‌شود. در دوره آموزش مقدماتی، ابتدا با محیط کار متلب و نحوه‌ی نوشتن M-File و قوانین مربوط به استفاده از آن آشنا شده، در ادامه به محاسبات ماتریسی و توابع مربوط به ماتریس‌ها در متلب، نحوه‌ی کاربری عملگرهای منطقی و رابطه‌ای، کنترل روند برنامه و مصور سازی داده‌ها می‌پردازیم، و در پایان با رابط گرافیکی کاربر (GUI) و مدل‌سازی سیستم‌ها در محیط Simulink آشنا می‌شوید. از آنجا که تسلط بر نرم افزار متلب برای فعالان رشته های فنی و مهندسی ، ضروری است ، شرکت در این دوره برای دانشجویان و شاغلین این رشته ها توصیه می‌شود. همچنین افرادی که قصد طراحی سیستم و شبیه‌سازی آن را دارند، می توانند با این دوره کار خود را شروع کنند .','2014-08-09 13:11:03','سایت','Class',35,500000,'MATLAB-logo.jpg','image/jpeg',25147,'2014-06-07 13:12:21','2014-06-07 13:12:21','2015-07-17 08:19:39',NULL,0),(2,'جاوااسکریپت','طراحی سایت، مستقل از زمان','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','برنامه‌های تحت وب، به‌طور پیوسته در حال پیشرفت هستند. در سال‌های اخیر نیز گسترش این برنامه‌ها در داخل ایران به‌وضوح قابل مشاهده‌ است. داشتن یک رابط کاربری جذاب و هم‌چنین یک ساختار قوی و سریع در سمت سرور، از مهم‌ترین نکات در بحث برنامه‌نویسی وب است. جاوااسکریپت با استفاده از کتاب‌خانه‌های قدرتمند و سیستم آسنکرون، جایگاه خود را در این حیطه به‌دست آورده و طبق آماری که از سایت http://redmonk.com/ گرفته‌شده در حال حاضر بیشترین کد‌های موجود در سایت گیت‌هاب با زبان جاوااسکریپت نوشته شده‌اند. در کلاس «آموزش جاوا اسکریپت» مباحثی چون آشنایی با خود زبان و شیوه‌های برنامه‌نویسی (تابعی و شی‌گرا) تا استفاده از ساختار MVC و آشنایی با چند کتاب‌خانه‌ی کاربردی جاوااسکریپت از جمله backbone.js، پوشش داده می‌شود. این کلاس با توجه به آموزش ساختاری زبان جاوااسکریپت، به‌تمامی افرادی که علاقه‌مند به طراحی وب (چه در سمت کاربر و چه در سمت سرور) توصیه می‌شود.','2014-08-09 13:13:03','سایت','Class',50,500000,'javascript_logo_unofficial-300x300.png','image/png',73770,'2014-06-07 13:23:49','2014-06-07 13:23:49','2015-07-17 08:19:39',NULL,0),(3,'دروپال','مدیریت محتوا با جامعه‌ی کاربر و توسعه‌دهنده‌ی بزرگ','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','با گسترش همگانی اینترنت، سازمان‌ها و مشاغل مختلف برای معرفی خود و خدماتی که ارائه می‌دهند نیاز به وب‌سایت دارند تا این اهداف را برآورده سازد. عموما این گونه سایت‌ها شبیه به هم هستند و قسمت‌های مشترک زیادی دارند، مثلا اعلام خبر، بخش ارتباط، عضویت و... هم‌چنین نیاز‌هایی نیز به صورت اختصاصی تعریف شود. دروپال چارچوبی است برای مدیریت محتوا، با قابلیت اضافه‌ شدن ماژول‌های مختلف برای نیاز‌های خاص. آموزش دروپال از دو قسمت «راه‌اندازی یک سایت مبتنی بر محتوا با استفاده از این چارچوب» و «نوشتن ماژول‌ خاص برای این چارچوب» تشکیل می‌شود. برای نمونه سایت دانشکده‌ی مهندسی برق و کامپیوتر از این چارچوب استفاده می‌کند و در حال حاضر دانشکده به‌دنبال گسترش این سایت است. در حال حاضر ۲.۱ درصد تمام وب‌سایت‌های دنیا با این چارچوب نوشته شده‌اند. با توجه به کاربرد بسیار گسترده‌ و سرعت بالای این چارچوب برای راه‌اندازی سایت‌های مبتنی بر محتوا، یادگیری دروپال می‌تواند ابزار قدرتمندی برای هر کس به وجود بیاورد.','2014-08-09 13:24:03','سایت','Class',25,500000,'druplicon.large_.png','image/png',25329,'2014-06-07 13:28:53','2014-06-07 13:28:53','2015-07-17 08:19:39',NULL,0),(4,'پایتون','قدرتمند، سطح بالا، منعطف','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','پایتون یک زبان اسکریپتی سطح بالا است که کاربرد آن دامنه‌ی وسیعی را در بر می‌گیرد (از تحقیق‌های علمی، محاسبات ریاضی و شبیه‌سازی‌ها تا چارچوب‌های اینترنت و گرافیک کامپیوتری). در کلاس «آموزش پایتون»، از آموزش گرامر و ساختار این زبان و تکنیک‌های برنامه‌نویسی تا آشنایی با کتاب‌خانه‌ها و استفاده از آن‌ها و آشنایی با چارچوبdjango  پوشش داده می‌شود. یادگیری زبان پایتون با توجه به کتاب‌خانه‌های متنوع و سطح بالا و اسکریپتی‌بودنش، در هر مقطعی می‌تواند کمک بزرگی محسوب شود.','2014-08-09 13:28:03','سایت','Class',35,500000,'300px-Python-logo-notext.svg.png','image/png',13229,'2014-06-07 13:39:27','2014-06-07 13:39:27','2015-07-17 08:19:39',NULL,0),(5,'آمادگی برای مسابقات ای‌سی‌ام','سه نفر، یک کامپیوتر و... الگوریتم','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','مسابقات ACM ICPC یکی از مهم‌ترین مسابقات برنامه‌نویسی در دنیا است. در این مسابقه، تیم‌های سه نفره با استفاده از تنها یک کامپیوتر در زمان ۵ ساعت، سوال‌های الگوریتمی و برنامه‌نویسی را حل می‌کنند. پایه‌ی این مسابقات بر اساس الگوریتم است. این مسابقات در اواخر پاییز به‌صورت منطقه‌ای در دانشگاه شریف برگزار می‌شود و برگزیدگان آن به مسابقات جهانی می‌روند. هر دانشگاه در این مسابقات سهمیه‌ی محدود دارد که هر سال با توجه به وضعیت سال گذشته‌ی آن دانشگاه تعیین می‌شود. در کلاس «آمادگی برای مسابقاتACM ICPC»، ساختار‌داده‌های مختلف و پرکاربرد، الگوریتم‌ها و حوزه‌های مختلف مثل گراف، هندسه‌ی محاسباتی، برنامه‌نویسی پویا و... مورد بحث قرار می‌گیرند. هم‌چنین تکنیک‌های برنامه‌نویسی سرعتی مثل ماکرو‌ها، عبارت منظم و... آموزش داده‌ می‌شود. با توجه به این‌که مباحث این کلاس در دروس «ساختمان داده» و «طراحی الگوریتم» کاربرد دارد، شرکت در آن به تمامی دانشجویان ورودی ۹۲ پیشنهاد می‌شود. هم‌چنین هر هفته مسابقه‌ی هفتگی مرتبط با کلاس برگزار می‌شود و شرکت در این مسابقات در انتخاب تیم‌‌های منتخب دانشگاه تاثیر دارد.','2014-07-18 04:39:03','سایت','Class',45,350000,'ACM-Logo1.jpg','image/jpeg',242104,'2014-06-07 13:40:59','2014-06-07 13:41:00','2015-07-17 08:19:39',NULL,0),(6,'نظریه‌ی بازی‌ها','بازی با ذهن زیبا','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n\r\n','تقریبا هر لحظه‌ای از زندگی شما، یک بازی است. تمرین یک درس را تحویل بدهم یا نه؟ تقلب کنم یا نه؟ در فوتبال و ضربه‌ی پنالتی به سمت چپ شوت کنم یا سمت راست؟ به عنوان دروازه‌بان به سمت چپ بپرم یا راست؟ زمانی که با دوستم می‌خواهم به سینما بروم به فیلم مورد علاقه‌ی خودم بروم یا فیلم مورد علاقه‌ی وی؟ اگر صدای جیغی در خیابان به گوش برسد به پلیس زنگ بزنم یا نزنم؟ تمامی این موقعیت‌ها یک بازی هستند و شما بازیکنی هستید که باید استراتژی خود را انتخاب کنید تا در مبارزه با دیگران به بیش‌ترین سود برسید. در حلقه‌ی نظریه‌ی بازی‌ها مقدمه‌ای از این مبحث را بیان می‌کنیم و در رابطه با کاربرد‌های آن در علوم کامپیوتر و هم‌چنین اقتصاد بحث می‌کنیم.','2014-08-30 07:30:03','سایت','Ring',15,150000,'GameTheory.jpg','image/jpeg',119534,'2014-06-09 02:59:32','2014-06-07 15:01:09','2015-07-17 08:19:39',NULL,0),(7,'Gamification','I want to play a game...','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n\r\n<p>\r\nدر جلسه‌ی سوم این حلقه، مقالات مرتبط با این مبحث که توسط شرکت‌کنندگان مطالعه شده‌است مورد بررسی قرار می‌گیرد. زمان آن نیز در پایان جلسه‌ی دوم تعیین می‌شود\r\n</p>','<p>آیا حاضر هستید به یک غریبه بگویید که هر روز کجا و با چه کسانی رفت‌و‌آمد می‌کنید؟ آیا حاضر هستید در شرکت‌تان روزی دو ساعت بیش‌تر کار کنید بدون این‌که پول بیش‌تری بگیرید؟ آیا حاضر هستید در ایستگاه مترو از پله استفاده کنید، حتی اگر پله‌برقی خلوت باشد؟ آیا حاضر هستید زباله‌های کنار یک سطل زباله را بلند کنید و داخل سطل بیاندازید؟ مبحث جدیدی به‌نام Gamification وجود دارد که باعث می‌شود آدم‌ها حاضر باشند تمام کارهایی که گفته‌شد را انجام دهند. در این حلقه مقدمه، مثال‌ها و جنبه‌های مختلف Gamification را بررسی می‌کنیم. مثال‌های این مبحث را می‌توانید در فیس‌بوک، TheFunTheory ،Nike+ ،Foursquare و... ببینید.</p>\r\n','2014-08-09 02:40:03','سایت','Ring',15,150000,'game-of-thrones-poster_85627-1920x1200.jpg','image/jpeg',223284,'2014-06-09 02:45:45','2014-06-09 02:45:46','2015-07-17 08:19:39',NULL,0),(8,'ویراستاری','به زبان آدمیزاد','<br>\r\n<p>\r\n<strong>\r\nزمان جلسات، بعد از پایان ثبت‌نام با مشورت شرکت‌کنندگان تعیین می‌شود.\r\n</strong>\r\n<p>','آدمیزاد ناگهان ترمز احساسات طبیعی‌اش را کشید و در انتخاب کلمات و عبارات احتیاط کرد تا دسته‌گلی به آب ندهد. اما از صراحت چون خیری ندیده‌‌بود، کم‌کم به دوپهلونویسی و درازنویسی و لاجرم به مُهمل‌نگاری رو آورد. کلیشه‌نویسی، درازنویسی، بیهوده‌نویسی، و در یک کلام شلخته‌نگاری سال‌هاست که در نوشته‌های ما جا خوش کرده‌است و ظاهرا به این راحتی‌ها بیرون‌رفتنی نیست. شلخته‌نگاری دامنه‌ی بسیار وسیعی دارد و به مطبوعات و رسانه‌های جمعی و حتی کتاب‌های درسی هم سرایت کرده‌است. در این حلقه می‌خواهیم تمرین کنیم که ساده، صریح، موجز، بی‌ابهام و بی‌پیرایه بنویسیم. می‌خواهیم حرمت خودمان، حرمت زبان مادری‌مان، و حرمت مخاطب‌هایمان را پاس بداریم. می‌خواهیم سعی کنیم زبان نوشته‌هایمان تا جای ممکن طبیعی، نزدیک به زبان گفتاری، منسجم و منطقی، و در یک کلام «پاکیزه» باشد. می‌خواهیم فارسی را درست بنویسیم.','2014-10-03 06:16:03','سایت','Ring',6,150000,'Editing.jpg','image/jpeg',95629,'2014-06-10 05:30:59','2014-06-10 05:30:59','2015-07-17 08:19:39',NULL,0),(9,'فتوشاپ','قوه‌ی خلاقیت خود را رها کنید...','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','کلمه‌ی «فتوشاپ» دیگر از نام یک نرم‌افزار فراتر رفته‌است و به یک اصطلاح در فرهنگ عامه‌ی مردم تبدیل شده‌است و به هر پدیده‌ای که یا می‌خواهند خلاف واقع جلوه دهند یا خارق‌العاده است می‌گویند «فتوشاپه». در کلاس «آموزش نرم‌افزار فتوشاپ»  که به صورت مقدماتی برگزار می‌شود، از آشنایی اولیه با محیط این برنامه و معرفی ابزار‌ها تا کار با فیلترها و رتوش عکس پوشش داده می‌شود. تمرکز این کلاس، آموزش ابزار‌هایی است که بیش‌ترین کاربرد را دارد تا بتوانید به آسانی کارهای ابتدایی گرافیکی خود را به تنهایی انجام دهید. با توجه به کاربرد بسیار بالای ویرایش عکس، شرکت در این کلاس به دانشجویان مهندسی، دانشجویان غیرمهندسی و  غیردانشجویان کلا توصیه می‌شود.','2014-08-08 11:29:03','سایت','Class',20,450000,'logo-photoshop.png','image/png',220774,'2014-06-12 11:31:16','2014-06-12 11:31:16','2015-07-17 08:19:39',NULL,0),(10,'طراحی وب - مقدماتی','شروع طراحی وب','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۲۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','وب‌سایت شخصی می‌خواهید اما سی‌اس‌اس و جاوااسکریپت بلد نیستید؟ در زبان اچ‌تی‌ام‌ال تازه‌کار هستید؟ دربه‌در دنبال یک طراح وب می‌گردید تا یک کار ساده برایتان انجام دهد؟ پس دست نگه‌ دارید! این حلقه مخصوص شماست. در این حلقه به‌طور مختصر با ابزارهای طراحی وب و  زبان جاوااسکریپت آشنا می‌شوید و احتمالا (اگر اندکی ذوق داشته‌باشید!) می‌توانید در نهایت وب‌سایت شخصی خودتان را طراحی کنید.','2014-07-11 11:42:03','سایت','Ring',40,350000,'HTML5CSS3.jpg','image/jpeg',77452,'2014-06-12 12:05:38','2014-06-12 12:05:38','2015-07-17 08:19:39',NULL,0),(12,'کارآموزی','کارآموزی','در این پروژه نیاز به کارآموز در سه بخش است. بخش اول: عنوان: شنود کردن ترافیک شبکه برای به‌دست آوردن اطلاعات لازم برای ساختن موتور جستجو (search engine). پیشنیازها: آشنا به زبان جاوا و علاقه‌مند به شبکه. ترجیحا آشنا به شبکه و زبان اسکالا بخش دوم: عنوان: کار با bts برای شنود و نفوذ به شبکه مخابرات پیشنیازها: آشنا به مخابرات و سیگنال و علاقه‌مند به امنیت بخش سوم: شنود شبکه برای به‌دست آوردن اطلاعات امنیتی و جلوگیری از حملات ایترنتی (مثال: botnet detection using clustering & classification)  پیشنیازها: آشنایی با طبقه‌بندی و خوشه‌بندی علاقه‌مند به امنیت و شبکه','در این پروژه نیاز به کارآموز در سه بخش است.  <p> <h4>بخش اول: </h4></p> <p> عنوان: شنود کردن ترافیک شبکه برای به‌دست آوردن اطلاعات لازم برای ساختن موتور جستجو (search engine). </p> <p> پیشنیازها: آشنا به زبان جاوا و علاقه‌مند به شبکه. ترجیحا آشنا به شبکه و زبان اسکالا </p> <p> <h4> بخش دوم: </h4> </p>  <p> عنوان: کار با bts برای شنود و نفوذ به شبکه مخابرات </p> <p> پیشنیازها: آشنا به مخابرات و سیگنال و علاقه‌مند به امنیت </p> <p> <h4> بخش سوم: </h4> </p> <p> عنوان: شنود شبکه برای به‌دست آوردن اطلاعات امنیتی و جلوگیری از حملات ایترنتی (مثال: botnet detection using clustering & classification)</p> <p> پیشنیازها: آشنایی با طبقه‌بندی و خوشه‌بندی علاقه‌مند به امنیت و شبکه </p>','2014-06-22 03:12:03','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:27:34','2014-06-16 03:13:23','2015-07-17 08:19:39',NULL,0),(13,'آزمایشگاه رباتیک پیشرفته و سیستم‌های هوشمند','بازی‌های کامپیوتری','جایگاه بازی‌های کامپیوتری در دنیای امروز بر هیچ کسی‌ پوشیده نیست، با گسترش و همه‌گیر شدن گوشی‌های تلفن هم‌راه هوشمند که مجهز به سیستم‌عامل‌های قدرتمند هستند بازی‌های کامپیوتری نیز گسترش چشم‌گیری پیدا کرده است. امروز مخاطبان آن فقط نوجوانان نیستند، بلکه افراد با هر سنی‌ و هر شغلی‌ و با هر سطح درآمدی می‌توانند مخاطبان بازی‌های کامپیوتری باشند. با این حال منصفانه نیست که بگوییم بازی‌ها فقط به قصد سرگرمی ساخته می‌شوند، در این دنیای پر هیجان مصارف آموزشی نیز وجود دارد. مطالعات و بررسی‌‌ها نشان داده است که درس دادن به کمک محیط‌های بازی توجه کاربران را بیشتر جلب می‌کند، ترس از یادگیری را از بین می‌برد، انگیزه یادگیری را در آنها افزایش می‌دهد و همچنین یادگیری را ماندگارتر می‌کند. یکی‌ دیگر از گونه‌های نوظهور بازی‌ها، بازی‌های غیرِ جدی (Casual Game) هستند. این بازی‌ها قوانین بسیار ساده‌ای دارند و یادگیری آنها ساده است. به پردازنده‌های قدرتمند نیاز ندارد، در تاکسی و اتوبوس می‌توان به این بازی‌ها پرداخت. ساخت و انتشار این نوع از بازی‌ها معمولا کم‌هزینه است. این بازی‌ها معمولا بر روی کامپیوتر‌های شخصی‌ و با استفاده از مرورگر‌های وب و یا بر روی گوشی‌های تلفن همراه و تبلت‌ها قابل بازی کردن هستند. هدف این بازی‌ها سرگرم کردن همه افراد در هر زمان و هر مکانی است. همین ویژگی‌‌ها باعث شده است که این بازی‌ها در دنیای شلوغ و پر دردسر امروز که افراد وقتی‌ برای تفریح ندارند بتوانند جایگاهی برای  خود پیدا کنند و می‌توان گفت در حالِ حاضر پرطرفدار‌ترین بازی‌های موجود در بازار از این دست بازی‌ها هستند. اگر به طراحی و ساخت این دست از بازی‌ها علاقه دارید میتوانید فعالیت خود را در آزمایشگاه هوش مصنوعی و رباتیک آغاز کنید. این آزمایشگاه در گذشته چند بازی آموزشی طراحی و به بازار عرضه کرده است، و در حال حاضر نیز چند پروژه بازی آموزشی در حال انجام است، اگر علاقه مند باشید می‌توانید به این پروژه‌ها ملحق شوید. همچنین با شکل گیری کلوپ بازی سازی دانشگاه تهران و ارتباط با گرافیست‌ها و هنرمندان از سایر دانشکده‌های دانشگاه تهران، فضا برای فعالیت بیشتر در این زمینه باز شده است و می‌توان این زمینه را به صورت حرفه‌ای‌تر در دانشگاه ادامه داد. دانشجویانی که علاقه‌مند به فعالیت در زمینه‌های مختلف بازی‌سازی (برنامه‌نویسی، طراحی شخصیت، انیمیشن، طراحی محیط و...) در قالب کارآموزی و یا خارج از آن هستند میتوانند با ایمیلsajad.mowlaei@gmail.com   ارتباط برقرار کنند، تا با تخصص‌های لازم در آزمایشگاه، پیش‌نیاز‌های موجود و پروژه‌های جاری بیشتر آشنا شوند.','جایگاه بازی‌های کامپیوتری در دنیای امروز بر هیچ کسی‌ پوشیده نیست، با گسترش و همه‌گیر شدن گوشی‌های تلفن هم‌راه هوشمند که مجهز به سیستم‌عامل‌های قدرتمند هستند بازی‌های کامپیوتری نیز گسترش چشم‌گیری پیدا کرده است. امروز مخاطبان آن فقط نوجوانان نیستند، بلکه افراد با هر سنی‌ و هر شغلی‌ و با هر سطح درآمدی می‌توانند مخاطبان بازی‌های کامپیوتری باشند. با این حال منصفانه نیست که بگوییم بازی‌ها فقط به قصد سرگرمی ساخته می‌شوند، در این دنیای پر هیجان مصارف آموزشی نیز وجود دارد. مطالعات و بررسی‌‌ها نشان داده است که درس دادن به کمک محیط‌های بازی توجه کاربران را بیشتر جلب می‌کند، ترس از یادگیری را از بین می‌برد، انگیزه یادگیری را در آنها افزایش می‌دهد و همچنین یادگیری را ماندگارتر می‌کند. یکی‌ دیگر از گونه‌های نوظهور بازی‌ها، بازی‌های غیرِ جدی (Casual Game) هستند. این بازی‌ها قوانین بسیار ساده‌ای دارند و یادگیری آنها ساده است. به پردازنده‌های قدرتمند نیاز ندارد، در تاکسی و اتوبوس می‌توان به این بازی‌ها پرداخت. ساخت و انتشار این نوع از بازی‌ها معمولا کم‌هزینه است. این بازی‌ها معمولا بر روی کامپیوتر‌های شخصی‌ و با استفاده از مرورگر‌های وب و یا بر روی گوشی‌های تلفن همراه و تبلت‌ها قابل بازی کردن هستند. هدف این بازی‌ها سرگرم کردن همه افراد در هر زمان و هر مکانی است. همین ویژگی‌‌ها باعث شده است که این بازی‌ها در دنیای شلوغ و پر دردسر امروز که افراد وقتی‌ برای تفریح ندارند بتوانند جایگاهی برای  خود پیدا کنند و می‌توان گفت در حالِ حاضر پرطرفدار‌ترین بازی‌های موجود در بازار از این دست بازی‌ها هستند. اگر به طراحی و ساخت این دست از بازی‌ها علاقه دارید میتوانید فعالیت خود را در آزمایشگاه هوش مصنوعی و رباتیک آغاز کنید. این آزمایشگاه در گذشته چند بازی آموزشی طراحی و به بازار عرضه کرده است، و در حال حاضر نیز چند پروژه بازی آموزشی در حال انجام است، اگر علاقه مند باشید می‌توانید به این پروژه‌ها ملحق شوید. همچنین با شکل گیری کلوپ بازی سازی دانشگاه تهران و ارتباط با گرافیست‌ها و هنرمندان از سایر دانشکده‌های دانشگاه تهران، فضا برای فعالیت بیشتر در این زمینه باز شده است و می‌توان این زمینه را به صورت حرفه‌ای‌تر در دانشگاه ادامه داد. دانشجویانی که علاقه‌مند به فعالیت در زمینه‌های مختلف بازی‌سازی (برنامه‌نویسی، طراحی شخصیت، انیمیشن، طراحی محیط و...) در قالب کارآموزی و یا خارج از آن هستند میتوانند با ایمیلsajad.mowlaei@gmail.com   ارتباط برقرار کنند، تا با تخصص‌های لازم در آزمایشگاه، پیش‌نیاز‌های موجود و پروژه‌های جاری بیشتر آشنا شوند.','2014-06-22 03:17:03','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:27:59','2014-06-16 03:18:24','2015-07-17 08:19:39',NULL,0),(14,'آزمایشگاه سیستم‌های هوشمند','کارآموزی','یک موقعیت کارآموزی پیرامون پردازش معنایی داده‌های متنی در آزمایشگاه سیستم‌های هوشمند اطلاعات تحت سرپرستی دکتر شاکری تعریف شده است. کارآموز باید مسلط به زبان جاوا باشد و مهم‌تر از آن باید علاقه‌مند و مستعد بوده که بتواند حتی برخی مسائل پژوهشی را خودش برطرف کند.  در صورتی که نیاز به اطلاعات بیشتری دارید می‌توانید به آزمایشگاه ۳۱۴ ساختمان جدید مراجعه کنید.','یک موقعیت کارآموزی پیرامون پردازش معنایی داده‌های متنی در آزمایشگاه سیستم‌های هوشمند اطلاعات تحت سرپرستی دکتر شاکری تعریف شده است. کارآموز باید مسلط به زبان جاوا باشد و مهم‌تر از آن باید علاقه‌مند و مستعد بوده که بتواند حتی برخی مسائل پژوهشی را خودش برطرف کند.  در صورتی که نیاز به اطلاعات بیشتری دارید می‌توانید به آزمایشگاه ۳۱۴ ساختمان جدید مراجعه کنید.','2014-06-22 03:19:03','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:28:23','2014-06-16 03:20:18','2015-07-17 08:19:39',NULL,0),(15,'High Performance Computing','محاسبات سریع','منابع محاسباتی و در دسترس بودن آن، جزء لازمی از تحقیق و پژوهش است. پژوهش‌گران همواره از سرویس‌های محاسباتی دانشگاه‌ها و مراکز تحقیقاتی برای رفع نیازهای محاسباتی خود استفاده می‌کنند. متأسفانه در ایران، سیستم متمرکزی که به صورت عمومی سرویس محاسباتی قابل قبول ارائه کنند وجود ندارد. دیده می‌شود که اغلب اساتید و آزمایشگاه‌ها برای تأمین نیازهای محاسباتی خود به خرید سیستم‌های محدود در محیط آزمایشگاه خود بسنده می‌کنند. در حالی که با هزینه‌ی کمتری در مجموع می‌توان سیستم متمرکزی برای تأمین نیازهای تمامی آزمایشگاه‌ها، حداقل در پردیس دانشگاه، ساخت. کاهش زمان اجرا، کاهش توان مصرفی، خنک‌سازی (cooling)، استفاده از تمامی قابلیت‌های منابع سخت‌افزاری (High Throughput Computing)، ارائه‌ی پلت‌فرم‌های موازی برای پردازش سریع (HPC) از مزیت‌های چنین سیستمی است. در گام بعدی، می‌توان آن را به ارائه‌ی این سرویس در سطح کشور گسترش داد. مراکز مختلف مانند پژوهشگاه دانش‌های بنیادی (IPM)، دانشگاه امیرکبیر، و دانشگاه صنعتی اصفهان تلاش‌هایی در این راستا کرده‌اند که یا موفق نبوده‌اند و یا به صورت عمومی جواب‌گوی نیاز پژوهش‌گران کشور نیستند. از نظر ما، اولین گام برای ساخت چنین زیرساختی، یک‌پارچه‌سازی (integration) همین منابع موجود است. با این هدف که با یک‌پارچه‌سازی منابع محاسباتی موجود در کشور و همین‌طور فرصت‌های تعامل با گرید اروپا، منابع موجود به بهترین نحو ممکن بهره‌برداری شوند. <br> فرصت کارآموزی به عنوان بخشی از این پروژه، که یک منبع محاسباتی برای حوزه‌ی بیولوژی محاسباتی و بیوانفورماتیک است، نیاز به طراحی یک زبان با حوزه‌ی خاص (Domain-specific) یا DSL به زبان Scala داریم. این DSL قرار است نیازهای برنامه‌نویسی بیولوژیست‌ها را برآورده و همین‌طور امکان اجرای مقیاس‌پذیر (scalable) برنامه‌های نوشته‌شده با این زبان را فراهم کند. به همین دلیل، با همکاری پژوهشگاه دانش‌های بنیادی (IPM) یا شرکت‌های حامی خواهان جذب کارآموز علاقمند در این زمینه هستیم. در صورت داشتن تخصص یا علاقه با ali.ghaffaari@ipm.ir تماس بگیرید و در صورت داشتن هر گونه سؤالی، از پرسیدن آن دریغ نورزید!','<p> <h4> مقدمه </h4> </p> <p>منابع محاسباتی و در دسترس بودن آن، جزء لازمی از تحقیق و پژوهش است. پژوهش‌گران همواره از سرویس‌های محاسباتی دانشگاه‌ها و مراکز تحقیقاتی برای رفع نیازهای محاسباتی خود استفاده می‌کنند. متأسفانه در ایران، سیستم متمرکزی که به صورت عمومی سرویس محاسباتی قابل قبول ارائه کنند وجود ندارد. دیده می‌شود که اغلب اساتید و آزمایشگاه‌ها برای تأمین نیازهای محاسباتی خود به خرید سیستم‌های محدود در محیط آزمایشگاه خود بسنده می‌کنند. در حالی که با هزینه‌ی کمتری در مجموع می‌توان سیستم متمرکزی برای تأمین نیازهای تمامی آزمایشگاه‌ها، حداقل در پردیس دانشگاه، ساخت. کاهش زمان اجرا، کاهش توان مصرفی، خنک‌سازی (cooling)، استفاده از تمامی قابلیت‌های منابع سخت‌افزاری (High Throughput Computing)، ارائه‌ی پلت‌فرم‌های موازی برای پردازش سریع (HPC) از مزیت‌های چنین سیستمی است. در گام بعدی، می‌توان آن را به ارائه‌ی این سرویس در سطح کشور گسترش داد. مراکز مختلف مانند پژوهشگاه دانش‌های بنیادی (IPM)، دانشگاه امیرکبیر، و دانشگاه صنعتی اصفهان تلاش‌هایی در این راستا کرده‌اند که یا موفق نبوده‌اند و یا به صورت عمومی جواب‌گوی نیاز پژوهش‌گران کشور نیستند. از نظر ما، اولین گام برای ساخت چنین زیرساختی، یک‌پارچه‌سازی (integration) همین منابع موجود است. با این هدف که با یک‌پارچه‌سازی منابع محاسباتی موجود در کشور و همین‌طور فرصت‌های تعامل با گرید اروپا، منابع موجود به بهترین نحو ممکن بهره‌برداری شوند. </p> <p> <h4> فرصت کارآموزی </h4> </p> <p>  به عنوان بخشی از این پروژه، که یک منبع محاسباتی برای حوزه‌ی بیولوژی محاسباتی و بیوانفورماتیک است، نیاز به طراحی یک زبان با حوزه‌ی خاص (Domain-specific) یا DSL به زبان Scala داریم. این DSL قرار است نیازهای برنامه‌نویسی بیولوژیست‌ها را برآورده و همین‌طور امکان اجرای مقیاس‌پذیر (scalable) برنامه‌های نوشته‌شده با این زبان را فراهم کند. به همین دلیل، با همکاری پژوهشگاه دانش‌های بنیادی (IPM) یا شرکت‌های حامی خواهان جذب کارآموز علاقمند در این زمینه هستیم. در صورت داشتن تخصص یا علاقه با ali.ghaffaari@ipm.ir تماس بگیرید و در صورت داشتن هر گونه سؤالی، از پرسیدن آن دریغ نورزید! </p>','2014-06-22 03:21:03','سایت','Lab',999,0,'hpc-future-trends.jpg','image/jpeg',493574,'2014-06-19 08:36:20','2014-06-16 03:23:42','2015-07-17 08:19:39',NULL,0),(16,'سایت دانشکده‌ی برق و کامپیوتر','کارآموزی','دانشکده مهندسی برق و کامپیوتر در تابستان ۱۳۹۳، تعدادی کارآموز جهت مرکز کامپیوتر دانشکده از بین دانشجویان این دانشکده پذیرش می‌نماید. لذا از علاقه‌مندان درخواست می‌نماید رزومه خود را به آدرس info@ece.ut.a.c.ir ارسال نمایند.','دانشکده مهندسی برق و کامپیوتر در تابستان ۱۳۹۳، تعدادی کارآموز جهت مرکز کامپیوتر دانشکده از بین دانشجویان این دانشکده پذیرش می‌نماید. لذا از علاقه‌مندان درخواست می‌نماید رزومه خود را به آدرس info@ece.ut.a.c.ir ارسال نمایند.','2014-06-22 03:25:03','سایت','Lab',999,0,'_logo.png','image/png',20933,'2014-06-19 08:30:13','2014-06-16 03:26:41','2015-07-17 08:19:39',NULL,0),(17,'آزمایشگاه سیستم‌های بی‌درنگ اتکاپذیر','کارآموزی','<p> حداکثر ۲ نفر کارآموز برای تابستان ۱۳۹۳ </p> <p> زمینه‌ها: سیستم‌عامل بی‌درنگ، الگوریتم‌های زمان‌بندی، سیستم‌عامل‌ نهفته، به‌کارگیری از برخی شبیه‌ساز‌ها، برنامه‌نویس اپلیکیشن‌های خاص‌منظوره </p> <p> پیش‌نیاز: معماری کامپیوتر، سیستم‌عامل، (optional) طراحی الگوریتم و شبیه‌سازی</p>','<p> حداکثر ۲ نفر کارآموز برای تابستان ۱۳۹۳ </p> <p> زمینه‌ها: سیستم‌عامل بی‌درنگ، الگوریتم‌های زمان‌بندی، سیستم‌عامل‌ نهفته، به‌کارگیری از برخی شبیه‌ساز‌ها، برنامه‌نویس اپلیکیشن‌های خاص‌منظوره </p> <p> پیش‌نیاز: معماری کامپیوتر، سیستم‌عامل، (optional) طراحی الگوریتم و شبیه‌سازی</p>','2014-06-22 03:27:03','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:28:30','2014-06-16 03:33:30','2015-07-17 08:19:39',NULL,0),(18,'General Game Playing','عامل هوشمند، واقعا هوشمند','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>',' تا حالا برای مسابقه‌های هوش‌مصنوعی عامل هوش‌مند طراحی کردین؟ برای کدوم مسابقه؟ مثلا شطرنج؟ عامل شما می‌تونست در مسابقه دوز هم بازی کنه؟ دوز که خیلی ساده‌تره که! می‌خوایم یک عامل هوشمند طراحی کنیم که توانایی شرکت توی همه‌ی بازی‌های مختلف رو داشته باشه، یعنی قوانین بازی رو بفهمه، استراتژی بچینه و برنده بشه، تنهای تنها.','2014-07-14 08:56:03','سایت','Ring',20,150000,'ggp.jpeg','image/jpeg',133272,'2014-06-19 09:00:32','2014-06-19 09:00:32','2015-07-17 08:19:39',NULL,0),(19,'کارآموزی','پردازش متن طبیعی','<p> برای کارآموزی در آزمایشگاه پردازش متن و زبان طبیعی موضوعات زیر مطرح هستند که دانشجویان می توانند روی آنها کار کنند</p>\r\n<p> -   ارائه الگوریتم هوشمند جهت محاسبه شباهت معنایی بین دو جمله زبان فارسی و انگلیسی</p>\r\n<p> -   پیاده سازی الگوریتم تشخیص مهمترین افراد تاثیرگذار در شبکه های اجتماعی بزرگ</p>\r\n<p> -   پیاده سازی ابزاری جهت نمایش ساختمان داده درخت </p>\r\n <p> -   پیاده سازی سیستم هوشمند محاسبه احتمال حضور یک جمله در زبان انگلیسی یا فارسی به زبان C++</p>\r\n <p> -   ارائه یک الگوریتم مترجم هوشمند متون انگلیسی به فارسی با روش dynamic programming</p>\r\n<p> -   ارائه سیستمی text 2 speech برای یک جمله انگلیسی </p>','<p> برای کارآموزی در آزمایشگاه پردازش متن و زبان طبیعی موضوعات زیر مطرح هستند که دانشجویان می توانند روی آنها کار کنند</p>\r\n<p> -   ارائه الگوریتم هوشمند جهت محاسبه شباهت معنایی بین دو جمله زبان فارسی و انگلیسی</p>\r\n<p> -   پیاده سازی الگوریتم تشخیص مهمترین افراد تاثیرگذار در شبکه های اجتماعی بزرگ</p>\r\n<p> -   پیاده سازی ابزاری جهت نمایش ساختمان داده درخت </p>\r\n <p> -   پیاده سازی سیستم هوشمند محاسبه احتمال حضور یک جمله در زبان انگلیسی یا فارسی به زبان C++</p>\r\n <p> -   ارائه یک الگوریتم مترجم هوشمند متون انگلیسی به فارسی با روش dynamic programming</p>\r\n<p> -   ارائه سیستمی text 2 speech برای یک جمله انگلیسی </p>','2014-06-25 09:02:03','سایت','Lab',999,0,'Karamoozi.PNG','image/png',13793,'2014-06-19 18:28:38','2014-06-19 09:07:29','2015-07-17 08:19:39',NULL,0),(20,'آشنایی با اصول مارکتینگ','آیا محصولی که بر اساس ایده‌ی قوی و با تکنولوژی فنی عالی تولیدشده باشد قطعا به فروش خواهدرفت؟','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۵۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<p>دوره در ۱۰ جلسه برگزار می‌شود. زمان برگزاری کلاس نیز روزهای شنبه ساعت ۱۷:۳۰ است. </p>','<p> آیا شما هم جزو آن دسته از مهندسینی هستید که قصد دارید در آینده یک کسب‌وکار راه‌اندازی کنید و با تولید ایده‌های‌تان درآمد کسب کنید؟ آن دسته از کارآفرینان آینده که در نظر دارید یک محصول خیلی خوب تولید کنید و فکر می‌کنید به‌محض ورود محصول خارق‌العاده‌ی شما به بازار درآمد بسیار زیادی کسب خواهید نمود؟ </p>\r\n\r\n<p> تاریخ بارها شکست محصولات فنی قوی را به نمایش گذاشته و موجب تعجب مدیران، کارآفرینان و مهندسینی که با دیدی مشابه شما تلاش به عرضه محصول به بازار نموده‌اند شده‌است. دلیل این اتفاق جامع در چه چیزی نهفته است؟ </p>\r\n\r\n<p> در این دوره سعی می‌کنیم علاقه‌مندان را با مفاهیم فروش و مارکتینگ آشنا و در راستای توسعه‌ی دید کارآفرینان و مدیران آینده تلاش کنیم. </p>\r\n\r\n<p> چنانچه به موضوعاتی از این دست علاقه دارید و علل موفقیت محصولاتی که به نظر فنی شما خیلی ویژه نبوده‌اند و یا شکست محصولاتی که از نظر تولیدکننده بسیار کارا بوده‌اند، برای شما جذابیت دارد در این دوره شرکت نمایید. </p>\r\n','2014-08-13 09:11:03','سایت','Class',30,400000,'marketing.jpg','image/jpeg',11425,'2014-06-19 11:52:09','2014-06-19 09:12:59','2015-07-17 08:19:39',NULL,0),(21,'Transactional Analysis','دوره‌ی تحلیل رفتار متقابل','هزینه‌ی شرکت در دوره: ۱۳۰ هزارتومان','<p>تحلیل رفتار متقابل یک تئوری روان‌شناسی است که توسط دکتر اریک برن در سال ۱۹۵۰ میلادی ارائه شد و به لحاظ کاربرد آن در حل مشکلات احساسی و رفتاری، مورد قبول جامعه‌ی روان‌شناسی قرار گرفت و به‌تدریج در زمینه‌های مشاوره، روان‌کاوی، گروه‌درمانی، مدیریت، جامعه‌شناسی، توسعه‌ی سازمانی و آموزش، نظریه‌های جدیدی ارائه نمود و گسترش پیدا کرد. این دوره در تمام نقاط جهان به‌عنوان یک مسیر خودشناسی و آشنایی با روان‌شناسی تجربی برای همه‌ی سطوح جامعه برگزار می‌شود. در دوره‌ی تحلیل رفتار متقابل ما با دلیل عکس‌العمل‌ها و رفتارهای خود در طول شبانه‌روز آشنا می‌شویم و با آشنا شدن هر چه بیش‌تر با احوالات و آموختن نوع بیان، ابراز احساس و افکار خویش٬ قدم تازه‌ای برای درک درون خود و کنترل آن‌ برمی‌داریم. با این روش می‌توان روشن كرد كه در لایه‌های زیرین ارتباطات جاری بین انسان‌ها به‌واقع چه چیزی در حال رخ دادن است.\r\n</p>\r\n\r\n<p> <strong>\r\nقبل از شروع کلاس تحلیل روابط متقابل، یک جلسه‌ی معارفه در تاریخ ۲۵ تیر برگزار خواهدشد. حضور در جلسه‌ی معارفه برای تمام عزیزانی که قصد شرکت در کلاس را دارند، اجباری است. پس از حضور در این جلسه‌، در صورت عدم تمایل می‌توانید ثبت‌نام خود را لغو کنید.\r\n</strong>\r\n</p>\r\n\r\n<p>\r\nاین دوره در قالب کارگاه‌های تئوری و عملی برگزار می‌شود و شامل ۱۲ جلسه‌ی سه‌ساعته در ۱۲ هفته‌ی متوالی است.\r\n</p>\r\n\r\n','2014-08-12 09:15:03','سایت','Class',40,1300000,'ta.jpg','image/jpeg',38373,'2014-06-19 09:17:04','2014-06-19 09:17:04','2015-07-17 08:19:39',NULL,0),(22,'جاوای پیشرفته (اندروید)','زبان شی‌گرای سازمانی','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','زبان جاوا یکی از پرکاربرد‌ترین زبان‌های سطح بالا است که در پروژه‌های بزرگ زیادی به کار رفته است و در حال حاضر زبان پایه‌ی برنامه‌های مبتنی بر سیستم‌عامل اندروید است. در این کلاس با مروری سریع بر مقدمات این زبان، تکنیک‌ها و الگو‌های متداولی که بر این زبان حاکم است مورد بحث قرار گرفته می‌شود. مطالب این کلاس، دانش ابتدایی مورد نیاز برنامه‌نویسی اندروید را پوشش می‌دهد. \r\nهم‌چنین شرکت‌کنندگان در این کلاس باید قبلا جاوا کار کرده باشند.\r\nلازم به‌ذکر است که این کلاس پیش‌نیاز کارگاه آموزشی اندروید است که به‌زودی توسط شاخه‌ی دانشجویی ای‌سی‌ام  برگزار می‌شود.','2014-07-18 04:01:03','سایت','Class',40,450000,'java-logo.jpg','image/jpeg',37158,'2014-06-19 19:04:18','2014-06-19 19:04:18','2015-07-17 08:19:39',NULL,0),(23,'جاوا','آموزش کار با جاوا برای مبتدیان','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>','<p>شروع برنامه‌نویسی به زبان جاوا برای مبتدیان</p>\r\n<p>\r\nجاوا معروف‌ترین و پر استفاده‌ترین زبان برنامه‌نویسی است! از جاوا به طور خاص بیش از هر زبان دیگری برای Enterprise Applications استفاده می‌شود.\r\nاین زبان با ماشین مجازی‌اش قادر به اجرا شدن روی هر ماشینی بدون وابستگی به سیستم‌عامل آن ماشین است!\r\nهدف این کلاس دانشجویانی‌است که با زبان C++ آشنایی دارند و قصد یادگیری زبان جاوا را دارند است.\r\n</p>','2014-08-15 05:00:03','سایت','Class',50,450000,'java-logo.jpg','image/jpeg',37158,'2014-07-09 10:09:02','2014-07-09 10:09:03','2015-07-17 08:19:39',NULL,0),(24,'اندروید','نوشتن برنامه‌ی موبایل را از همین الان شروع کنید','<p>\r\nپیش‌نیاز شرکت در این ورک‌شاپ، تسلط نسبی به زبان جاوا است. برای یادگیری زبان جاوا می‌توانید در کلاس‌های \r\n<a href=\"http://acm.ut.ac.ir/events/events/23\"> جاوای مقدماتی </a>\r\nیا \r\n<a href=\"http://acm.ut.ac.ir/events/events/22\"> جاوای پیشرفته (اندروید) </a>\r\nثبت نام کنید.\r\n</p>\r\n<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی مهندسی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۷۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table> \r\n\r\n<p> \r\nناهار و پذیرایی در طول ۳ روز ورک‌شاپ به‌عهده‌ی شاخه‌ی دانشجویی ای‌سی‌ام است. هم‌چنین دانشجویان دانشکده‌ی مهندسی برق و کامپیوتر دانشگاه تهران می‌توانند در روز شروع ورک‌شاپ با مراجعه به دفتر باقی پول خود را دریافت کنن.\r\n<p>','در یک کارسوق (ورک‌شاپ) سه‌روزه یاد بگیرید چگونه برنامه‌ی اندروید بنویسید.\r\n','2014-09-02 04:36:03','سایت','Workshop',50,2250000,'android.png','image/png',51173,'2014-07-13 05:48:11','2014-07-13 05:48:12','2015-07-17 08:19:39',NULL,0),(25,'مجله‌ی اف‌یک','توزیع شماره‌ی جدید مجله‌ی اف‌یک','<div style=\"font-size: 28px\">\r\n<p>\r\nشما می‌توانید نسخه‌ی جدید مجله را با ۵۰ درصد تخفیف و به قیمت ۲۰۰۰ تومان پیش‌خرید کنید و در مراسم رونمایی تحویل بگیرید.\r\n\r\n</p>\r\n\r\n</div>','<p>\r\nاز همان روزی که چاپ روزنامه و نشریات کاغذی رایج شد تا امروز که بیش‌تر مقالات و اخبار به‌صورت الکترونیکی منتشر می‌شود، هر رسانه‌ای که از تکرار فاصله نگیرد و ایده‌ای نو نداشته‌باشد، مخاطبان خود را از دست می‌دهد. از این‌رو بر آن شدیم تا تحولاتی در جهت بهبود نشریه داشته‌باشیم؛ تغییراتی که از دو شماره‌ی قبل با تغییر در شیوه‌ی نگارش و در شماره‌ی قبل با تغییراتی ظاهری در صفحه‌آرایی آغاز شد و با ورود اف‌یک به دهه‌ی دوم انتشار خود، در این شماره با تغییراتی در ساختار مطالب ادامه یافت.\r\n</p>\r\n<p> \r\nشاید مشخص‌ترین تغییر انتخاب یک موضوع تخصصی برای هر فصل است که سهم بیش‌تری از مطالب هر شماره به آن اختصاص می‌یابد. انتخاب «موضوع فصل» این امکان را فراهم می‌کند تا با موضوعاتی که کم‌تر به آن‌ها توجه شده‌است بیش‌تر آشنا شویم.  این فصل موضوع «بازی‌سازی» را انتخاب کردیم. موضوعی که با وجود اهمیت زیاد، در ایران و به‌ویژه در دانشگاه تهران کمتر مورد توجه قرار گرفته‌است. معرفی کوتاه از بازی‌سازی، گفت‌وگو با رییس هیات مدیره‌ی بنیاد ملی بازی‌‌های رایانه‌ای (دکتر مینایی) و مقالات تخصصی از مواردی است که در این شماره خواهید خواند.\r\n</p> \r\n<p>\r\nاخبار دانشکده، مروری بر رویداد‌های مهم فصل، بررسی جشنواره‌ی مهندسی اینترنت، مقاله‌ی «ردپای ما در اینترنت»، تغییرات رشته‌ی مهندسی کامپیوتر به قلم دکتر کارگهی از دیگر مطالبی است که در این شماره خواهید خواند.\r\nشماره‌ی یازدهم اف‌یک در روز یکشنبه نوزدهم مردادماه منتشر خواهد شد. در این روز در دانشکده‌ی مهندسی برق و کامپیوتر منتظر حضورتان هستیم.\r\n</p>','2014-08-16 00:30:03','سایت','F1',999,20000,'F1-poster-11-3.jpg','image/jpeg',109547,'2014-08-05 17:04:13','2014-08-05 17:04:14','2015-07-17 08:19:39',NULL,0),(26,'جذب نیرو در گروه ارزش‌آفرین شریف','جذب نیرو در گروه ارزش‌آفرین شریف','<p>\r\nاگر در هر یک از زمینه های زیر علاقمند به همکاری هستید، با ما تماس بگیرید و به جمع ما بپیوندید.\r\n<ul>\r\n<li>\r\nمدیریت و امنیت شبکه\r\n</li>\r\n<li>\r\nبرنامه نویسی به زبان Python\r\n</li>\r\n<li>\r\nسابقه مفید در کار کردن با Wordpress\r\n</li>\r\n</ul>\r\n</p>\r\n<p>\r\nمزایا و شرایط  کار کردن در این پروژه :\r\n\r\n<ul>\r\n<li>\r\nهمکاری بصورت پاره وقت یا تمام وقت\r\n</li>\r\n<li>\r\nتجربه کاری مفید\r\n</li>\r\n<li>\r\nحقوق بالا\r\n</li>\r\n<li>\r\nمحیط کاری مناسب با سطح علمی بالا\r\n</li>\r\n</p>\r\n\r\n<h3>\r\nایمیل: job@sharifin.com\r\n</h3>\r\n<br>\r\n<h3>\r\nشماره‌ی تماس: 09122044682\r\n</h3>','<p>\r\nگروه ارزش آفرین شریف مفتخر خواهد بود برای همکاری در پروژه ای منحصر به فرد و با ابعاد گسترده از خلاقیت، دانش و توان فنی شما نیز بهره مند گردد.\r\n</p>','2014-10-02 17:53:03','Site','Lab',50,0,'Screenshot_from_2014-09-22_21_34_02.png','image/png',50596,'2014-09-22 18:06:13','2014-09-22 18:04:06','2015-07-17 08:19:39',NULL,0),(27,'کارگاه آموزشی دو روزه‌ی PsychToolBox','کارگاه آموزشی دو روزه‌ی PsychToolBox','<p>\r\n<h4>\r\n در ابتدای دوره زبان برنامه نویسی متلب آموزش داده می شود.\r\n</h4>\r\n<h3>\r\nبرای ثبت‌نام در کارگاه آموزشی می‌توانید از \r\n<a href=\"http://acm.ut.ac.ir/psychtoolbox\">\r\nاین‌جا \r\n</a>\r\nاقدام کنید.\r\n</h3>\r\n<p>\r\nزمان برگزاری: چهارشنبه ۹۳/۷/۲۳ ساعت ۱۴ تا ۱۸\r\n<br/>\r\nپنج‌شنبه ۹۳/۷/۲۵ ساعت ۹ تا ۱۲ و ۱۴ تا ۱۸\r\n<br/>\r\nمکان برگزاری: امیرآباد - دانشکده‌ی فنی دانشگاه تهران - دانشکده‌ی برق و کامپیوتر\r\nمحل دقیق برگزاری متعاقبا به اطلاع شرکت‌کنندگان خواهد رسید.\r\n</p>','<p>\r\nآموزش گام به گام به همراه طراحی یک آزمایش سایکوفیزیک\r\n</p>\r\n<p>\r\nبا همکاری ستاد توسع علوم و فناوری های شناختی، گروه هوش ماشین و رباتیک و شاخه دانشجویی ACM دانشکده فنی دانشگاه تهران.\r\n</p>\r\n','2014-10-21 09:55:03','Site','Workshop',100,0,'Setad.logo.jpg','image/jpeg',11464,'2014-09-24 10:12:08','2014-09-24 10:12:08','2015-07-17 08:19:39',NULL,0),(28,'همایش جامع جاوا‌اسکرپیت','همایش جامع جاوا‌اسکرپیت','<p>در این همایش با متدها، تکنولوژی‌ها و فریم‌ورک‌های جدید در زمینه‌ی جاوا اسکریپت آشنا خواهیدشد که به شما این امکان را می‌دهد تا بتوانید زمینه‌ی فعالیت خود را بهتر انتخاب کنید. بدیهی است هدف تنها ارتقا و به‌روزرسانی سطح علمی کسانی است که علاقه دارند تا با ویژگی‌های جدید برنامه‌نویسی و همچنین استفاده از فریم‌ورک‌های این زبان آشنا شوند . محور‌های آموزشی این همایش به شرح زیر است :‌</p>\r\n					\r\n					<div class=\"row\">\r\n						<div class=\"col-md-6\">\r\n							<ul>\r\n								<li>دام ( مدل شی گرایی سند )‌ ( DOM  )</li>	\r\n								<li>کامپایلر </li>	\r\n								<li>ساخت اپلیکیشن (Application Architecture &amp; Desing Pattern)</li>	\r\n								<li>کار با فایل های صوتی</li>	\r\n								<li>کار با فایل های ویدیویی</li>	\r\n								<li>سمت سرور (Nodejs, Socket.io, Offline, Comm)</li>	\r\n								<li>موتور ( جستجو - محاسبه - پیش پردازشگر ها - بازی ) </li>	\r\n							</ul>\r\n						</div>\r\n						<div class=\"col-md-6\">\r\n							<ul>\r\n								<li>الگو</li>	\r\n								<li>ساخت بازی دو بعدی و سه بعدی</li>	\r\n								<li>طراحی ( نمودار - اجسام سه بعدی - چارت ها - المان های وب )</li>	\r\n								<li>اپلیکیشن‌های هایبریدی</li>	\r\n								<li>خطایابی </li>	\r\n								<li>ابزار توسعه</li>	\r\n							</ul>\r\n						</div>\r\n					</div>','<p>\r\nجاوا اسکریپت یکی از قدرتمندترین زبان‌های برنامه‌نویسی و هم‌چنان در حال رشد و توسعه است. از این‌رو گروه آموزشی بوت‌ویک با هم‌کاری انجمن علمی مهندسی کامپیوتر دانشگاه تهران در اقدامی بی‌سابقه با جمع‌آوری مطالب و متد‌های روز دنیا قصد دارند تا طی همایشی جامع، این مطالب را به علاقه‌مندان ارائه کنند.\r\n</p>\r\n\r\n<p>\r\nبرای اطلاعات بیش‌تر و ثبت‌نام می‌توانید به سایت \r\n<a href=\"http://www.tehranconf.com\"> همایش جامع جاوا‌اسکریپت</a>\r\nمراجعه کنید.\r\n\r\n</p>','2014-10-21 11:16:03','Site','Workshop',999,0,'IMG_0849.JPG','image/jpeg',988943,'2014-10-01 05:13:01','2014-09-27 11:20:29','2015-07-17 08:19:39',NULL,0),(29,'فارسی‌نویسی به‌کمک صفحه‌کلید استاندارد فارسی','فارسی‌نویسی به‌کمک صفحه‌کلید استاندارد فارسی','<p>\r\n نکات مورد بحث در این سمینار دقیقا «الفبا»ست. اگر نوشتن روی کاغذ نیازمند دانستن الفبای نگارش است، برای نوشتن در کامپیوتر و برای وب باید چند نکته‌ی فنی را هم بر آن الفبای نخستین اضافه کنید؛ در غیر این صورت، فرد بی‌سوادی محسوب می‌شوید.\r\n</p>','<p>\r\nهنوز هستند خیلی‌ها که مقدماتی‌ترین الفبای فنی نگارش در کامپیوتر و برای وب را یا نمی‌دانند، یا می‌دانند و رعایت نمی‌کنند. این سمینار بدون وارد شدن به موضوع رسم‌الخط و ویرایش، الفبای فنی فارسی‌نویسی در کامپیوتر و برای وب را به شما می‌آموزد.\r\n</p>','2014-10-07 11:25:03','Site','Workshop',40,0,'Seminar_-_2.jpg','image/jpeg',40117,'2014-09-27 23:29:04','2014-09-27 23:29:04','2015-07-17 08:19:39',NULL,0),(30,'61شناخت توانایی‌ها برای دانشجویان','برای پیشرفت باید نقاط ضعف را از بین برد یا توانایی‌ها را افزایش داد؟','آزمون:  \r\n\r\nدر زمینه خودشناسی آزمون‌های مختلفی وجود دارد. شاید از معروف‌ترین و همه‌گیرترین آزمون‌ها که در ایران هم شناخته‌شده هستند بتوان به DISC ، MBTIو MMPI اشاره کرد. در کنار این آزمون‌ها، آزمون شناخت توانایی‌ها (Strengths Finder) هم وجود دارد که در طول سال‌های گذشته بخش مهمی از دوره‌های شناخت توانایی‌ها بوده‌است. این آزمون براساس تحقیق موسسه گالوپ شکل گرفته‌است و تم‌های توانایی هر فرد را در غالب ٣۴ تم معرفی می‌کند. تفاوت این آزمون نسبت به دیگر آزمون‌ها این است که برمبنای رویکرد روان‌شناسی مثبت‌گرا تهیه شده و بیشتر تمرکز آن برشناخت نقاط قوت و استعدادها است. این آزمون کمک می‌کند تا بتوانید درک بهتری از قابلیت‌های خود داشته‌باشید و دلیل بسیاری از رفتارها و احساس‌های تکراری در طول زندگی را دریابید.\r\n<br><br>\r\n \r\n\r\n<b>این دوره شامل چهار جلسه‌ است که در هر جلسه برای درک مفاهیم از بازی‌ها و فعالیت‌های فردی و گروهی استفاده خواهدشد. قبل از شروع دوره نیز، یک همایش آشنایی در تاریخ ۴ آذر ماه ساعت ۱۲ برگزار خواهدشد. حضور در همایش معارفه برای تمام عزیزانی که قصد شرکت در کلاس را دارند، اجباری است.</b>\r\n<br><br>\r\n \r\n* ثبت‌نام دوره پس از همایش یادشده شروع می‌شود.<br>\r\n* آزمون شناخت توانایی‌ها به‌صورت اینترنتی گرفته می‌شود. <br>\r\n* این دوره شامل ۴ جلسه سه‌ساعته است. <br>\r\n* هزینه‌ی شرکت در دوره: ۷۰ هزارتومان<br>\r\n<br>\r\n<br>\r\nثبت‌نام تا روز سه‌شنبه ۱۱ آذر ادامه دارد.\r\n<br>\r\nکلاس در صورت رسیدن به حدنصاب تشکیل می‌شود.','ممکن است شما رشته‌ی تحصیلی خود را از روی علاقه انتخاب نکرده‌باشید. شاید هم با آگاهی کامل رشته و مسیر تحصیلی خود را انتخاب کرده‌باشید. در هر شرایط شما نیاز دارید تا در شروع، اهدافی متناسب با قابلیت‌های خود انتخاب کنید. ما در انجام فعالیت‌هایی برای رسیدن به اهدافی که متناسب با استعدادها و توانایی‌های‌مان تعریف شده‌اند عملکردی یکتا و بی‌نظیر خواهیم‌داشت و به دستاوردهای بزرگی می‌رسیم. شناخت توانایی‌های فردی به شما کمک می‌کند تا مسیر شغلی خود را متناسب با استعدادها و توانایی‌های‌تان انتخاب کنید و اهدافی متناسب با قابلیت‌های خود تعریف نمایید. \r\n\r\nمهم نیست که در زندگی چه نقشی دارید. مهم نیست که در کجای دنیا ایستاده‌اید. شما می‌توانید و قابلیت این را دارید که دنیا را با خود همراه کنید و شرایط را آن‌طور که می‌خواهید بسازید. شناخت توانایی‌ها به شما کمک می‌کند چون شما همواره در جست‌وجوی بهبود، رشد و تعالی هستید. شناخت توانایی‌ها به شما کمک می‌کند چون به چگونه بودن خود اهمیت می‌دهید و می‌خواهید نقش تاثیرگذار خود در زندگی را بیابید. شناخت توانایی‌ها به شما کمک می‌کند چون می‌خواهید روزهای زندگی را عادی سپری نکنید چرا که می‌دانید بزرگ‌ترین خیانت انسان به خودش این است که خودش را کشف نکند، قابلیت‌هایش را نشناسد و براساس آن‌ها زندگی نکند. شناخت توانایی‌ها به شما روی‌کرد و تفکری را می‌دهد که بتوانید همواره در مسیر رشد باقی بمانید. ','2014-12-15 08:30:00','Site','Workshop',200,700000,'web-super.jpg','image/jpeg',372954,'2014-11-25 17:20:53','2014-11-17 07:14:28','2015-07-18 07:46:38',NULL,0),(31,'اولین ایده بازار تخصصی مهندسی پزشکی','اولین ایده بازار تخصصی مهندسی پزشکی','ایده‌ی شما می‌ تواند طراحی و ساخت یک وسیله‌ی ساده و کاربردی در مهندسی پزشکی باشد و یا نوشتن یک نرم‌‌افزار کاربردی موبایل که نیازی را در این زمینه برطرف کند.\r\nبعد کافی‌ست کمی دقیق‌تر به دوستان خود نگاه کنید و ببینید کدام یک مهارتی دارند تا شما را در به‌ثمر رسیدن ایده‌ی خود یاری کنند. ایده‌ی خود را با آن‌ها کامل کنید و برای کسب حمایت‌های مادی و معنوی و شروع کسب‌وکار خلاقانه‌ی خود آن را با ما درمیان بگذارید.\r\n<br><br>\r\nنفر اول: ۵ میلیون ریال\r\n<br>\r\nحمایت ۵۰ میلیون ریالی به صورت بلاعوض از ۳ ایده‌ی اول\r\n<br>\r\n(در قالب حمایت از طرح های مرکز ایده‌پردازی، نوآوری و فناوری اداره کل انجمن های علمی دانشگاه امیرکبیر)\r\n<br>\r\nتقدیر و ارائه پوستر از ۱۰ ایده‌ی برتر در رویداد «ایده بازار»\r\n<br><br>\r\nمهلت ارسال ایده تا ۱۴ آذرماه\r\n<br>\r\nزمان رویداد ۷ام آذرماه\r\n<br><br>\r\nاین برنامه با همکاری انجمن‌های علمی مهندسی پزشکی دانشگاه امیرکبیر، مهندسی پزشکی و مهندسی کامپیوتر دانشگاه تهران برگزار می‌شود.\r\n','هر ایده یک اتفاق ساده و ناگهانی در ذهن شماست که در هر مکانی ممکن است بیافتد، وسط کلاس درس، کنار تخت بیمار، توی مترو، پشت فرمان ماشین و یا وقتی در پارکی شروع به دویدن می‌کنید. فقط کافی‌ست این اتفاق‌ها را کمی جدی بگیرید و به سادگی از کنارشان عبور نکنید.','2014-12-23 08:30:03','Site','Conference',200,0,'b06635332ce3c557fd2d0701e075f0796be2a5953bcdf54d0b7c7b1dccfb8ed5.jpg','image/jpeg',248738,'2014-11-25 17:22:12','2014-11-25 17:22:12','2015-07-17 08:19:39',NULL,0),(32,'کارگاه آموزشی جامع جاوااسکریپت','کارگاه آموزشی جامع جاوااسکریپت','موضوعات این کارگاه عبارت است از:\r\n<br><br>​​\r\n1. Introduction to Javascript (data types, expressions, operators, objects, arrays, functions, ...)\r\n<br>\r\n2. Client side libraries (jQuery, Angular.js)\r\n<br>\r\n3. Server side platform: Node.js, Socket.io\r\n<br>','جاوا اسکریپت یکی از قدرتمندترین زبان‌های برنامه‌نویسی و هم‌چنان در حال رشد و توسعه است. از این‌رو شاخه‌ی دانش‌جویی اِی‌سی‌اِم کارگاه آموزشی جاوااسکرپیت را برگزار می‌کند.','2014-12-23 08:30:03','Site','Workshop',999,200000,'JS.jpg','image/jpeg',307088,'2014-12-10 08:16:41','2014-11-30 16:25:37','2015-07-17 08:19:39',NULL,0),(33,'حلقه‌ی مهندسی نرم‌افزار-طراحی تحت وب','حلقه‌ی مهندسی نرم‌افزار-طراحی تحت وب',' به دانش‌جویان علاقه‌مند به همکاری در پروژه‌ی «انتخاب واحد مجازی» و دانشجویان ورودی ۹۲ توصیه می‌شود در این حلقه شرکت کنند.','در این حلقه قصد داریم با استفاده از مفاهیم اولیه‌ی مهندسی نرم‌افزار، چند پروژه‌ی تحت وب را از طراحی اولیه، تا پیاده‌سازی نهایی و آمایش جلو ببریم. از نکات مثبت این حلقه، می‌توان به تمرین عملی مفاهیم مهندسی نرم‌افزار مانند «امکان‌سنجی»، «مورد کاربردی»، «Class Diagram» و هم‌چنین آموزش زبان Ruby و فریم‌ورک Ruby On Rails نام برد. مهم‌تر از همه در کنار آموزش و تمرین مفاهیم، خروجی این حلقه ۳ پروژه‌ی اجرایی خواهدبود که به مرحله‌ی اجرا خواهد رسید. ','2014-12-29 08:30:03','Site','Ring',25,250000,'ruby_on_rails_web_version.jpg','image/jpeg',743340,'2014-12-18 20:09:10','2014-12-15 09:08:15','2015-07-17 08:19:39',NULL,0),(34,'گذری بر نظیریابی در داده‌های بزرگ','گذری بر نظیریابی در داده‌های بزرگ','در این گفتار، فرآیند نظیریابی داده‌ها (Data Matching)، یکی از فرآیندهای مهم در سامانه‌های تجمیع، درچهارچوب پردازش داده‌های بزرگ، مورد بررسی اجمالی قرار می‌گیرد. هدف از نظیریابی، یافتن اقلام داده‌ای یکسان در پایگاه‌های گوناگون است. به‌عنوان مثال، چنین سامانه‌ای باید قادر به تشخیص یکسان بودن دو رکورد (محمد رضا لطفی، نوازنده تار) و (م. ر. لطفی، تارنواز) باشد. در ادامه، مراحل مختلف این فرآیند، چالش‌های پیش رو، و برخی راه‌حل‌های پیشنهادشده مورد اشاره قرار خواهند گرفت.\r\n<br>\r\nشنبه ۶/۱۰/۹۳ ساعت ۱۲:۳۰ تا ۱۳:۳۰ کلاس ۸۰۳ طبقه هشتم ساختمان جدید دانشکده‌ی مهندسی برق و کامپیوتر',' روزی روزگاری: عمده‌ی داده‌های دنیا، ساخت‌یافته بودند. مدل‌های گوناگون پایگاهی، از سلسله‌مراتبی و شبکه‌ای تا مدل رابطه‌ای، برای مدیریت و استخراج اطلاعات ابداع شده و مورد بهره‌برداری قرار گرفته‌اند. در سال‌ها و دهه‌های اخیر، اما، عمده‌ی داده‌های تولیدشده، خصوصا در فضای وب، غیرساخت‌یافته و نیمه‌ساخت‌یافته هستند. داده‌های مربوط به موضوعات یکسان یا مرتبط، در قالب‌های متفاوت و گوناگونی عرضه می‌شوند (مانند صفحات HTML و متون زبان طبیعی)، و حاوی مقادیر قابل ملاحظه‌ای نویز هستند. از همین رو، تجمیع این داده‌ها در قالب یک مدل داده‌ای یکپارچه ، از جهت ارتقاء کیفیت داده‌ها، مدیریت حجم آنها و امکان اعمال روش‌های گوناگون استخراج اطلاعات و دانش، حائز اهمیت است. روش‌های نوین تجمیع داده‌ها (Data Integration) باید امکان یکنواخت‌سازی حجم بسیار زیادی از داده‌ها را با کیفیت بالا، در زمان قابل‌قبول و باکمترین میزان دخالت عامل انسانی فراهم آورند.','2015-01-02 09:00:03','Site','Talk',200,NULL,'adel.png','image/png',573019,'2014-12-25 18:06:56','2014-12-25 06:04:32','2015-07-17 08:19:39',NULL,0),(35,'Bitcoin & Deep Learning two icons of Data-Driven era','Bitcoin & Deep Learning two icons of Data-Driven era','Virtual currencies such as Bitcoin or Litecoin are the only viable solutions to develop micro-transaction economy that provide incentives for people to sell their data while protecting their privacy. At the same time with the explosion of data and high complexity of models, deep learning is the top candidate to make it possible to mine big data and use them for decision-making, medical diagnosis, behavioral analysis, crisis management and many other data driven industries.\r\n<br>\r\n یکشنبه ۱۲:۳۰ تا ۱۳:۳۰ آمفی‌تئاتر دانشکده‌ی مهندسی برق و کامپیوتر','There is a strong trend in different Industries to rely on data than experts & intuition for major policy making decisions. Ad-Revenue model has played a major role for the birth of big data in these industries. However this model is neither sustainable nor scalable. High cost of transactions in conventional currencies is the major deterrent to developing alternative business models.','2015-01-03 09:00:03','Site','Talk',200,NULL,'anghezi2.png','image/png',508942,'2014-12-25 09:31:05','2014-12-25 09:12:38','2015-07-17 08:19:39',NULL,0),(36,'On Streaming and Communication Complexity of the Set Cover Problem','On Streaming and Communication Complexity of the Set Cover Problem','Our approach uses randomization, which we show is necessary: no deterministic constant approximation is possible (even given exponential time) using $o(m n)$ space. These results are some of the first on streaming algorithms and efficient two-party communication protocols for approximation algorithms. Moreover, we show that our algorithm can be applied to multi-party communication model.\r\n<br>\r\nدوشنبه ۱۳ تا ۱۴ آمفی‌تئاتر دانشکده‌ی مهندسی برق و کامپیوتر','We develop the first streaming algorithm and the first two-part communication protocol that uses a constant number of passes/rounds and sublinear space/communication for logarithmic approximation to the classic \\prob{Set Cover} problem. Specifically, for $n$ elements and $m$ sets, our algorithm/protocol achieves a space bound of $O(m \\cdot n^\\delta \\log^2 n \\log m)$(for any $\\delta > 0$) using $O(4^{1/\\delta})$ passes/rounds while achieving an approximation factor of $O(4^{1/\\delta} \\log n)$ in polynomial time. If we allow the algorithm/protocol to spend exponential time per pass/round, we achieve an approximation factor of $O(4^{1/\\delta})$.','2015-01-04 09:30:03','Site','Talk',200,NULL,'anghezi.png','image/png',616300,'2014-12-25 09:30:49','2014-12-25 09:14:37','2015-07-17 08:19:40',NULL,0),(37,'GPU Programming','GPU Programming','','در این گفت‌وگو قصد داریم تا با بررسی مسائل زیر، نگاهی کوتاه به برنامه‌نویسی هم‌روند بر روی GPU داشته‌باشیم:<br>\r\n– ساختار (SIMD (Single Instruction, Multiple Data،<br>\r\n– برنامه‌های قابل محاسبه با استفاده از SIMD،<br>\r\n– معرفی چارچوب و مدل برنامه‌نویسی (CUDA(Compute Unified Device Architecture،<br>\r\n– معرفی پروژه‌ی درس تحقیق در عملیات که با استفاده از CUDA پیاده‌سازی شده‌است.<br>','2015-02-13 09:00:03','Site','Ring',200,0,'GPU_Programming.jpg','image/jpeg',98688,'2015-01-31 20:15:28','2015-01-31 20:15:29','2015-07-17 08:19:40',NULL,0),(39,'کلاس آموزشی فوتوشاپ','کلاس آموزشی فوتوشاپ','','آشنایی با محیط برنامه<br>\r\nآشنایی با ابزار های مختلف<br>\r\nروتوش تصاویر<br>\r\nکار با انواع فیلترها<br>\r\nآشنایی با Pixel Art<br>\r\nآشنایی با تصاویر وکتور','2015-02-27 10:30:03','Site','Class',30,250000,'Photoshop_class.jpg','image/jpeg',164228,'2015-02-11 18:28:36','2015-02-11 18:28:37','2015-07-17 08:19:40',NULL,0),(40,'Introduction to PHP and Apache','Introduction to PHP and Apache','','How to run Apache Server and MySQL Server<br>\r\nLearning syntax, features and basics of PHP<br>\r\nLearning PHP fundamental functions and core libraries<br>\r\nIntroduction to database and basics of SQL<br>\r\nHow to deal with MySQL in PHP<br>\r\n<br>\r\n<h6 style=\"color:red\">A basic knowledge of HTML and CSS is highly recommended.</h6>','2015-03-04 05:30:03','Site','Class',30,250000,'php.jpg','image/jpeg',385907,'2015-02-11 18:52:28','2015-02-11 18:52:28','2015-07-17 08:19:40',NULL,0),(41,'معرفی اولین جشنواره‌ی بازی‌های مستقل تهران','معرفی اولین جشنواره‌ی بازی‌های مستقل تهران','','مکان: کلاس ۲۱۱ ساختمان جدید دانشکده‌ی مهندسی برق و کامپیوتر','2015-02-20 09:00:03','Site','Conference',999,0,'Poster2.jpg','image/jpeg',452623,'2015-02-12 17:54:10','2015-02-12 17:54:11','2015-07-17 08:19:40',NULL,0),(42,'Coding Dojo Cup','جام کدینگ‌دوجو','حداکثر تعداد شرکت‌کنندگان: ۳۲ نفر<br>\r\nمهلت ثبت‌نام: سه‌شنبه ۱۹ اسفند‌ماه<br>\r\nهزینه‌ی ثبت‌نام: ۷۰۰۰ تومان<br>\r\nزمان برگزاری: جمعه ۲۲ اسفند ساعت ۹ تا ۱۳','سرعت خود را در برنامه‌نویسی به نمایش بگذارید.<br>\r\nیک روز تعطیل از صبح تا ظهر، با دوستان خود رقابت کنید. <br>\r\n+ سرگرمی‌های جذاب در حاشیه‌ی جام','2015-03-18 20:25:03','Site','Contests',32,70000,'CodingDoj_Poster.jpg','image/jpeg',162889,'2015-02-20 08:38:00','2015-02-20 08:38:01','2015-07-17 08:19:40',NULL,0),(43,'آموزش متلب','.محاسبه‌ی ایده‌ها، با ماتریس‌ها','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۶۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۷۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقمندان ابتدا باید مبلغ ۷۵۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','به جرأت میتوان گفت که متلب، مهمترین نرم افزار در پژوهش‌های علمی و شبیه‌سازیهای پیشرفته بخصوص در\r\nرشته‌های فنی مهندسی به شمار می‌رود . کاربرد این نرم‌افزار به قدری گسترده است که از محاسبات ساده‌ی ریاضی گرفته\r\nتا پیاده‌سازی الگوریتم‌های مختلف و پردازش سیگنال‌ها و تصاویر بسیار پیچیده را شامل می‌شود. در دوره آموزش مقدماتی،\r\nابتدا با محیط کار متلب و نحوهی نوشتن M-File و قوانین مربوط به استفاده از آن آشنا شده، در ادامه به محاسبات ماتریسی\r\nو توابع مربوط به ماتریس‌ها در متلب، نحوه‌ی کاربری عملگرهای منطقی و رابط‌های، کنترل روند برنامه و مصور سازی\r\nدادهها میپردازیم، و در پایان با رابط گرافیکی کاربر (GUI) و مدلسازی سیستمها در محیط Simulink آشنا میشوید. از\r\nآنجا که تسلط بر نرم افزار متلب برای فعالان رشته های فنی و مهندسی ، ضروری است ، شرکت در این دوره برای\r\nدانش‌جویان و شاغلین این رشته ها توصیه می‌شود. همچنین افرادی که قصد طراحی سیستم و شبیه‌سازی آن را دارند، می\r\nتوانند با این دوره کار خود را شروع کنند\r\n<br>\r\n<a href=\"http://acm.ut.ac.ir/acm/uploads/post_attachment/attachment/30/ACM_MATLAB_Course_Syllabus.pdf\">برای دیدن سرفصل‌ها کلیک کنید</a>','2015-07-28 19:25:03','Site','Class',45,750000,'pmat.png','image/png',92178,'2015-06-29 18:27:37','2015-06-29 18:27:37','2015-07-17 08:19:40',NULL,0),(44,'جاوااسکریپت پیشرفته','MEAN Machine','آشنایی و معرفی:<br>\r\n.1 معرفی و آشنایی با AngularJS<br>\r\n.2 معرفی و آشنایی با Node JS<br>\r\n.3 معرفی و آشنایی با MongoDB<br>\r\n.4 معرفی و آشنایی با Express JS<br>\r\n.5 آشنایی با دو نوع MEAN & LAMP Stack<br>\r\n.6 مقایسه دو نوع MEAN & LAMP Stack<br>\r\n.7 معرفی ابزارهای توسعه برای MEAN Stack<br>\r\n<br>\r\nشروع به کار:<br>\r\n.1 نصب و پیکرده بندی AngularJS<br>\r\n.2 نصب و پیکرده بندی Node JS + Express JS<br>\r\n.3 نصب و پیکرده بندی MongoDB<br>\r\n.4 راه اندازی ابتدایی وب سرور<br>\r\n\r\n<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۶۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۷۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقمندان ابتدا باید مبلغ ۷۵۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','مدرس: مهرداد فراهانی\r\n<br>\r\nبرنامه‌های تحت وب، به‌طور پیوسته در حال پیشرفت هستند. در سال‌های اخیر نیز گسترش این برنامه‌ها در داخل ایران\r\nبه‌وضوح قابل مشاهده است. داشتن یک رابط کاربری جذاب و همچنین یک ساختار قوی و سریع در سمت سرور، از\r\nمهمترین نکات در بحث برنامه‌نویسی وب است. جاوااسکریپت با استفاده از کتابخانه‌های قدرتمند و سیستم آسنکرون،\r\nجایگاه خود را در این حیطه به‌دست آورده و طبق آماری که از سایت \r\nhttp://redmonk.com/\r\n گرفته‌شده در حال\r\nحاضر بیشترین کدهای موجود در سایت گیت‌هاب با زبان جاوااسکریپت نوشته شده‌اند . » آموزش جاوا اسکریپت « در کلاس\r\nمباحثی چون آشنایی با خود زبان و شیوه‌های برنامه‌نویسی (تابعی و شی‌گرا) تا استفاده از ساختار \r\nMVC\r\n و آشنایی با چند کتابخانه‌ی کاربردی جاوااسکریپت پوشش داده میشود . این کلاس با توجه به آموزش ساختاری زبان جاوااسکریپت، به‌تمامی افرادی که علاقه‌مند به طراحی وب (چه در سمت کاربر و چه در سمت سرور) توصیه\r\nمی‌شود .\r\nدر این کلاس با تکنولوژیهای جاوااسکریپت بیشتر آشنا میشوید و در پایان کلاس یک پروژهی کاربردی که مشابه آن در\r\nلینک زیر وجود دارد انجام خواهید داد.\r\n<br>\r\n<a href=\"http://acm.ut.ac.ir/acm/uploads/post_attachment/attachment/31/__________.pdf\">پروژه کلاس</a>','2015-07-26 19:25:03','Site','Class',15,750000,'unnamed.jpg','image/jpeg',26617,'2015-07-02 15:27:55','2015-06-29 18:58:46','2015-07-17 08:19:40',NULL,0),(45,'جاوای مقدماتی','شروع برنامه‌نویسی به زبان جاوا برای مبتدیان','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۷۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۷۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>\r\n\r\n<p>\r\nموضوعاتی که در کلاس پوشش داده‌خواهدشد:\r\n</p>\r\n<p>\r\n<b>\r\n1. Overview\r\n<br>\r\n2. Classes and Objects\r\n<br>\r\n3. Packages\r\n<br>\r\n4. Inheritance\r\n<br>\r\n5. Exception Handling\r\n<br>\r\n6. IO and File\r\n<br>\r\n7. Networking\r\n</b>\r\n</p>','جاوا معروف‌ترین و پر استفاده‌ترین زبان برنامه‌نویسی است! از جاوا به طور خاص بیش از هر زبان دیگری برای\r\nEnterprise Applications استفاده می‌شود . این زبان با ماشین مجازی‌اش قادر به اجرا شدن روی هر ماشینی بدون\r\nوابستگی به سیستم‌عامل آن ماشین است! هدف این کلاس دانش‌جویانی‌ است که با زبان C++ آشنایی دارند و قصد یادگیری\r\nزبان جاوا را دارند است<br>\r\n<b>با توجه اینکه درس ساختمان داده در ترم پاییز ۹۴ با زبان جاوا کار خواهدشد، حضور در این کلاس به کلیه‌ی دانش‌جویان\r\nورودی ۹۳ توصیه می‌شود</b> .\r\n','2015-07-27 19:25:03','Site','Class',45,700000,'java2.jpg','image/jpeg',81950,'2015-06-29 19:19:53','2015-06-29 19:19:53','2015-07-17 08:19:40',NULL,0),(46,'آمادگی برای مسابقات ای‌سی‌ام','بادکنک‌ها را بدست آور','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۷۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقمندان ابتدا باید مبلغ ۷۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','سابقات ACM ICPC یکی از مهم‌ترین مسابقات برنامه‌نویسی در دنیا است. در این مسابقه، تیم‌های سه نفره با استفاده از تنها یک کامپیوتر در زمان ۵ ساعت، سوال‌های الگوریتمی و برنامه‌نویسی را حل می‌کنند. پایه‌ی این مسابقات بر اساس الگوریتم است. این مسابقات در اواخر پاییز به‌صورت منطقه‌ای در دانشگاه شریف برگزار می‌شود و برگزیدگان آن به مسابقات جهانی می‌روند. هر دانشگاه در این مسابقات سهمیه‌ی محدود دارد که هر سال با توجه به وضعیت سال گذشته‌ی آن دانشگاه تعیین می‌شود. در کلاس «آمادگی برای مسابقاتACM ICPC»، ساختار‌داده‌های مختلف و پرکاربرد، الگوریتم‌ها و حوزه‌های مختلف مثل گراف، هندسه‌ی محاسباتی، برنامه‌نویسی پویا و... مورد بحث قرار می‌گیرند. هم‌چنین تکنیک‌های برنامه‌نویسی سرعتی مثل ماکرو‌ها، عبارت منظم و... آموزش داده‌ می‌شود. با توجه به این‌که مباحث این کلاس در دروس «ساختمان داده» و «طراحی الگوریتم» کاربرد دارد، شرکت در آن به تمامی دانشجویان ورودی ۹۳ پیشنهاد می‌شود.','2015-07-27 19:25:03','Site','Class',25,700000,'ACM-Logo1.jpg','image/jpeg',242104,'2015-06-29 21:01:11','2015-06-29 21:01:11','2015-07-17 08:19:40',NULL,0),(47,'هک و امنیت شبکه','مبانی امنیت','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۷۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقمندان ابتدا باید مبلغ ۷۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','مدرس: محمدمهدی مختاری<br>\r\nامنیت موضوعی جذاب است که کمتر در دانشگاه‌ها به آن پرداخته می‌شود. در این کلاس، مبانی امنیت مورد بررسی قرار میگیرد و درصورت امکان، به صورت عملی بررسی میشود.\r\nموضوعات زیر مهمترین اهداف این کلاس را تشکیل میدهند:\r\n<br>\r\n1- ردیابی و مرحله شناسایی هدف<br>\r\n2- آنالیز سیستم عامل ها<br>\r\n3-  دسترسی گیری<br>\r\n4- بالا بردن دسترسی<br>\r\n5- بک دور<br>','2015-07-27 19:25:03','Site','Class',15,700000,'hackers_security_password-100004008-gallery.jpg','image/jpeg',29317,'2015-06-29 21:36:23','2015-06-29 21:33:48','2015-07-17 08:19:40',NULL,0),(48,'Transactional Analysis ','دوره خودشناسی،روانشناختی تحلیل رفتار متقابل و ارتباط با کودک درون','هزینه‌ی شرکت در دوره: ۱۸۵هزارتومان','<p>تحلیل رفتار متقابل یک تئوری روان‌شناسی است که توسط دکتر اریک برن در سال ۱۹۵۰ میلادی ارائه شد و به لحاظ کاربرد آن در حل مشکلات احساسی و رفتاری، مورد قبول جامعه‌ی روان‌شناسی قرار گرفت و به‌تدریج در زمینه‌های مشاوره، روان‌کاوی، گروه‌درمانی، مدیریت، جامعه‌شناسی، توسعه‌ی سازمانی و آموزش، نظریه‌های جدیدی ارائه نمود و گسترش پیدا کرد. این دوره در تمام نقاط جهان به‌عنوان یک مسیر خودشناسی و آشنایی با روان‌شناسی تجربی برای همه‌ی سطوح جامعه برگزار می‌شود. در دوره‌ی تحلیل رفتار متقابل ما با دلیل عکس‌العمل‌ها و رفتارهای خود در طول شبانه‌روز آشنا می‌شویم و با آشنا شدن هر چه بیش‌تر با احوالات و آموختن نوع بیان، ابراز احساس و افکار خویش٬ قدم تازه‌ای برای درک درون خود و کنترل آن‌ برمی‌داریم. با این روش می‌توان روشن كرد كه در لایه‌های زیرین ارتباطات جاری بین انسان‌ها به‌واقع چه چیزی در حال رخ دادن است.\r\n</p>\r\n\r\n\r\n<p>\r\nاین دوره در قالب کارگاه‌های تئوری و عملی برگزار می‌شود و شامل ۱۱ جلسه‌ی سه‌ساعته در ۱۱ هفته‌ی متوالی است.\r\n</p>\r\n\r\n','2015-07-24 19:29:00','Site','Class',20,1850000,'ta.jpg','image/jpeg',38373,'2015-06-30 05:10:23','2015-06-30 05:10:23','2015-07-17 08:19:40',NULL,0),(49,'General Game Playing','عامل هوشمند، واقعا هوشمند','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۲۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<p>\r\nلازم به ذکر تمامی افراد هزینه‌ی کامل کلاس را پرداخته و سپس از دفتر ای‌سی‌ام تخفیف خود را دریافت نمایید. امکان ثبت‌نام حضوری نیز در دفتر شاخه وجود دارد.\r\n</p>',' تا حالا برای مسابقه‌های هوش‌مصنوعی عامل هوش‌مند طراحی کردین؟ برای کدوم مسابقه؟ مثلا شطرنج؟ عامل شما می‌تونست در مسابقه دوز هم بازی کنه؟ دوز که خیلی ساده‌تره که! می‌خوایم یک عامل هوشمند طراحی کنیم که توانایی شرکت توی همه‌ی بازی‌های مختلف رو داشته باشه، یعنی قوانین بازی رو بفهمه، استراتژی بچینه و برنده بشه، تنهای تنها.','2015-07-26 19:25:03','Site','Ring',10,250000,'ggp.jpeg','image/jpeg',133272,'2015-06-30 05:46:55','2015-06-30 05:46:55','2015-07-17 08:19:40',NULL,0),(50,'آشنایی با اصول مارکتینگ','آیا محصولی که بر اساس ایده‌ی قوی و با تکنولوژی فنی عالی تولیدشده باشد قطعا به فروش خواهدرفت؟','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۶۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','<p> آیا شما هم جزو آن دسته از مهندسینی هستید که قصد دارید در آینده یک کسب‌وکار راه‌اندازی کنید و با تولید ایده‌های‌تان درآمد کسب کنید؟ آن دسته از کارآفرینان آینده که در نظر دارید یک محصول خیلی خوب تولید کنید و فکر می‌کنید به‌محض ورود محصول خارق‌العاده‌ی شما به بازار درآمد بسیار زیادی کسب خواهید نمود؟ </p>\r\n\r\n<p> تاریخ بارها شکست محصولات فنی قوی را به نمایش گذاشته و موجب تعجب مدیران، کارآفرینان و مهندسینی که با دیدی مشابه شما تلاش به عرضه محصول به بازار نموده‌اند شده‌است. دلیل این اتفاق جامع در چه چیزی نهفته است؟ </p>\r\n\r\n<p> در این دوره سعی می‌کنیم علاقه‌مندان را با مفاهیم فروش و مارکتینگ آشنا و در راستای توسعه‌ی دید کارآفرینان و مدیران آینده تلاش کنیم. </p>\r\n\r\n<p> چنانچه به موضوعاتی از این دست علاقه دارید و علل موفقیت محصولاتی که به نظر فنی شما خیلی ویژه نبوده‌اند و یا شکست محصولاتی که از نظر تولیدکننده بسیار کارا بوده‌اند، برای شما جذابیت دارد در این دوره شرکت نمایید. </p>\r\n','2015-07-26 18:25:03','Site','Class',15,600000,'marketing-strategy-full.png','image/png',7384,'2015-06-30 10:06:31','2015-06-30 09:08:07','2015-07-17 08:19:40',NULL,0),(52,'فوتوشاپ','زیبایی را خلق کنید...','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۵۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۶۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۶۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','مدرس:محمدمهدی مهدی‌زاده<br>\r\nاحتمالا تا به حال به نرم‌افزارهای قدرتمندی که ظاهر زیبایی ندارند برخورد کرده‌اید. یکی از مشکلات مهندسین نرم‌افزار همواره عدم توانایی آن‌ها در استفاده از نرم‌افزارهای ویرایشگر است. در کلاس «آموزش نرم‌افزار فتوشاپ» که به صورت مقدماتی برگزار می‌شود، از آشنایی اولیه با محیط این برنامه و معرفی ابزار‌ها تا کار با فیلترها و رتوش عکس پوشش داده می‌شود. تمرکز این کلاس، آموزش ابزار‌هایی است که بیش‌ترین کاربرد را دارد تا بتوانید به آسانی کارهای ابتدایی گرافیکی خود را به تنهایی انجام دهید. با توجه به کاربرد بسیار بالای ویرایش عکس، شرکت در این کلاس به دانشجویان مهندسی، دانشجویان غیرمهندسی و غیردانشجویان کلا توصیه می‌شود. <br>\r\n<b>همراه داشتن لپتاپ اکیدا توصیه می‌شود.</b>','2015-07-26 19:25:03','Site','Class',15,600000,'ps.jpg','image/jpeg',17989,'2015-06-30 09:41:12','2015-06-30 09:41:12','2015-07-17 08:19:40',NULL,0),(53,'Introduction to Git and Modern Source Code Management Techniques ','آشنایی با ابزار git و روش‌های مدرن مدیریت کد','<p>\r\nاین کلاس به صورت یک کارگاه ۳ ساعته، ۵شنبه ۱ مردادماه ساعت ۱۰ صبح برگزار خواهد شد.\r\n</p>\r\nهزینه‌ی این کلاس ۲۰۰۰۰ تومان است.\r\n</p>','\r\n<p>\r\nدر انجام پروژه‌های دانشگاهی، حتماً برای نگهداری نسخه‌های مختلف از فایل‌های خود از روش‌های متعددی استفاده کرده‌اید. مثلاً اینکه هر روز یک فولدر جدید که تاریخ همان روز را به عنوانش نامش انتخاب می‌کنید، می‌سازید و فایل‌ها را داخلش کپی می‌کنید. با این کار می‌توانید بعداً نسخه‌های قبلی پروژه و همین طور تغییراتی که بین نسخه‌های مختلف ایجاد شده را ببینید.\r\n</p>\r\n<p>\r\nاین کاری است که ابزارهای مدیریت کد و کنترل نسخه به صورت خودکار انجام می‌دهند. علاوه بر این، چنین ابزارهایی استفاده از یک کد مشترک را برای اعضای مختلف یک تیم آسان می‌کنند. مثلاُ ممکن است دو نفر همزمان روی یک فایل تغییراتی ایجاد کنند و یکی از آنها بدون اینکه دیگری متوجه شود، تغییرات او را از بین ببرد. این مشکلات در پروژه‌های تیمی در شرکت‌های نرم‌افزاری با فرکانس بیشتری رخ می‌دهند، و جلوگیری از آنها به شدت اهمیت دارد. تازه در پروژه‌های متن‌باز بزرگ مانند هسته‌ی لینوکس که هزاران نفر به صورت همزمان و با فرکانس بسیار بالا روی کد کار می‌کنند، این موضوع بسیار حیاتی‌تر خواهد بود.</p>\r\n<p>\r\n<p>\r\nدر این کارگاه با ابزار git که یکی از محبوب‌ترین نمونه‌های ابزارهای مدیریت کد و کنترل نسخه است آشنا می‌شویم و سعی می‌کنیم با استفاده از این ابزار، روش‌های صحیح مدیریت کد در محیط‌های کاری را بیاموزیم.\r\n</p>\r\n<b>\r\nشرکت در این کارگاه برای افرادی که در یکی از کلاس‌های تابستانی ای‌سی‌ام ثبت‌نام کنند رایگان است.\r\n</b>\r\n</p>','2015-07-23 19:25:00','Site','Workshop',22,200000,'git-logo.png','image/png',17037,'2015-07-01 19:16:36','2015-07-01 05:38:46','2015-07-22 07:34:37',NULL,0),(54,'Machine Learning','ماشین‌ها هم یاد می‌گیرند','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۲۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۱۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقمندان ابتدا باید مبلغ ۱۴۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','مدرس: شهاب بهجتی  <br>\r\nهدف این درس آشنایی با مفهوم یادگیری ماشین و الگوریتم‌های یادگیری است. یادگیری ماشین یک حوزه میان‌رشته‌ای مابین آمار و علم کامپیوتر بوده که با توسعه مدل‌های آماری آن‌ها را در قالب الگوریتم‌های کامپیوتری ارائه میکند.\r\n<br>\r\n<a href=\'http://acm.ut.ac.ir/acm/uploads/post_attachment/attachment/32/ML-Syllabus.pdf\'>برای دیدن سرفصل‌ها کلیک کنید.</a>\r\n<br>\r\n<b>درصورت نرسیدن تعداد شرکت‌کنندگان به حد نصاب، کلاس تشکیل نشده و میتوانید هزینه‌ی پرداخت شده را با مراجعه به دفتر شاخه دریافت کنید</b>\r\n','2015-07-26 19:29:03','Site','Class',25,1400000,'neurons.jpg','image/jpeg',21785,'2015-07-05 10:38:47','2015-07-05 10:38:47','2015-07-17 08:19:40',NULL,0),(55,'Image Processing','پردازش تصاویر، علم روز','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۰۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۲۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۱۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقمندان ابتدا باید مبلغ ۱۴۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','مدرس: آرش مهرجو<br>\r\nاگر کنفرانس Build امسال مایکروسافت را دیده باشید، اهمیت پردازش تصویر در دنیای امروز را به خوبی درک خواهید کرد. به طور کلی، پردازش تصویر علمی است که دو حوزه های مختلفی از جمله پزشکی و صنعتی کاربرد دارد و علاوه بر آن، موضوع جذابی برای کارهای پژوهشی هم شمرده می‌شود.\r\n<br>\r\n<a href=\'http://acm.ut.ac.ir/acm/uploads/post_attachment/attachment/33/ImageProcessing-topics.pdf\'>برای دیدن سرفصل‌ها کلیک کنید.</a>\r\n<br>\r\n<b>درصورت نرسیدن تعداد شرکت‌کنندگان به حد نصاب، کلاس تشکیل نشده و میتوانید هزینه‌ی پرداخت شده را با مراجعه به دفتر شاخه دریافت کنید</b>','2015-07-25 19:29:03','Site','Class',25,1400000,'computer_vision_mona_lisa.jpg','image/jpeg',19956,'2015-07-05 11:12:18','2015-07-05 11:12:18','2015-07-17 08:19:40',NULL,0),(56,'An introduction to scientific computing','مقدمه‌ای بر محاسبات علمی','','مدرس : مهندس حسین شفیعی ( استاد درس مهندسی اینترنت)\r\n<br>\r\nمحاسبات علمی شاخه‌ای از علم است که به ساخت مدل‌های ریاضی و روش‌های حل عددی و استفاده از رایانه‌ها برای تحلیل و حل مسائل علمی، علوم اجتماعی و مهندسی می‌پردازد.\r\n<br>\r\n<b>این کلاس برای تمام دانشجویان رایگان می‌باشد</b>','2015-07-25 19:29:03','Site','Class',25,0,'ScientificComputing-topics.jpg','image/jpeg',316785,'2015-07-05 11:35:18','2015-07-05 11:35:19','2015-07-17 08:19:40',NULL,0),(61,'کلاس طراحی وب مقدماتی','html و css','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشکده‌ی برق و کامپیوتر دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۳۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۴۰۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۵۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۵۵۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','امروزه برنامه‌های تحت وب، جای برنامه های دسکتاپ را گرفته اند و اکثر applicationهای قدیمی نیز درحال تغییر از یک برنامه‌ی دسکتاپ به یک سایت اینترنتی هستند. اما برای جذب مخاطب، تنها کیفیت محصول اهمیت ندارد و ظاهر آن نیز در جذب مخاطبان بسیار اهمیت میابد. در این کلاس با اصول اولیه طراحی ظاهر یک سایت اینترنتی آشنا میشوید.','2015-07-24 19:28:00','Site','Class',30,550000,'the_power_of_html5_and_css3_by_itomix-d4wa7to.png','image/png',45825,'2015-07-17 07:40:31','2015-07-17 07:40:32','2015-07-17 08:19:40',NULL,0),(62,'برنامه نویسی به زبان C++ و مبانی شیء گرایی','زبانی برای تمام فصول!','<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۳۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۳۵۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','زبان C++ بدون شک محبوب‌ترین و پراستفاده‌ترین زبان برنامه‌نویسی در دنیا است. این زبان علاوه آزادی زیادی که به برنامه‌نویس می‌دهد، امکان استفاده از مفهوم شیء گرایی(Object Orientation) را هم در خود نهاده است تا به زبانی قدرتمند تبدیل شود. در این کلاس، این مفهوم شیءگرایی به وسیله زبان C++ به علاقه‌مندان تدریس خواهد شد.','2015-07-24 19:28:00','Site','Class',30,350000,'programming_oop_wallpaper_red_by_hexeno.png','image/png',24837,'2015-07-17 08:29:43','2015-07-17 08:29:44','2015-07-19 09:27:09',NULL,0),(63,'کارگاه راه‌اندازی استارتاپ','از رویا تا واقعیت','<p>تبدیل چنین رؤیایی به واقعیت اگرچه محال نیست اما دشوارتر از آن چیزی است که در آغاز به نظر میرسید\r\n\r\nو عالوه بر آنکه مهم است هر فردی تصمیم درست بگیرد در کدام زمین و در چه نقشی بازی کند، همچنین \r\n\r\nمهم است که خود را برای بازی کردن در بازی دشوار راهاندازی یک استارتاپ آماده کند. به نظر میرسد این \r\n\r\nآماده نبودن یکی از ریشههای اصلی بسیاری از شکستهای کسانی است که کوشیدهاند رؤیاهای بزرگ زندگی \r\n\r\nخود را در قالب راهاندازی استارتاپ به واقعیت تبدیل کنند.\r\n</p><p>\r\n\r\nدر این کارگاه تالش خواهیم کرد به دیدی تاحدممکن شفاف نسبت به چرایی و چگونگی این آماده بودن و \r\n\r\nآماده شدن برای راهاندازی یک استارتاپ برسیم تا شاید شانس گذر از رؤیایی ذهنی به واقعیت را در راهاندازی \r\n\r\nاستارتاپ خود بیشتر کنیم.</p>\r\n\r\n<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۱۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','ارائه دهنده: محمد نجفی<br>\r\n<p>راهاندازی استارتاپ این روزها به رؤیای بسیاری از جوانان تبدیل شده است؛ وسوسه اینکه کسبوکاری شخصی\r\n\r\nخواهند داشت که در آن خودشان رییس خودشان هستند و در کوتاه زمانی پلههای ترقی و موفقیت را طی \r\n\r\nمیکنند و یک شبه ره صد ساله را میروند و پولدار هم میشوند.\r\n</p><p>\r\nاما واقعیتها چیز دیگری را نشان میدهند: اینکه بسیاری از استارتاپها بیشتر و احتماالً زودتر از آنچه \r\n\r\nمؤسسانشان تصور میکردند با دیوار بلند واقعیت برخورد میکنند و فقط تعداد کمی از آنها لذت موفقیت \r\n\r\nبیحد و حصر را نصیب مؤسسان خود میکنند.\r\n</p>\r\n<b>این کارگاه برای دانشجویانی که در برنامه‌ی Summer of Code شرکت کرده‌اند، رایگان میباشد. اما به دلیل محدودیت ظرفیت پیشنهاد ‌ می‌شود که از طریق سایت ثبت‌نام کنند.</b>','2015-07-24 19:05:00','Site','Workshop',40,100000,'startups1.jpg','image/jpeg',17523,'2015-07-17 09:14:39','2015-07-17 09:14:39','2015-07-17 09:19:43',NULL,0),(64,'کارگاه مدل کسب‌وکار در اکوسیستم موبایل','\"بازار\" را تسخیر کنید','<b>لازم به ذکر است علاقه‌مندان ابتدا باید مبلغ ۱۰۰۰۰۰ ريال را به صورت اینترنتی پرداخت کرده و سپس با مراجعه حضوری به اتاق ای‌سی‌ام، بقیه پول خود را پس بگیرند. همچنین امکان ثبت نام حضوری هم وجود دارد</b>','ارائه دهنده: محمد فراهانی\r\n<p>یک ایده خوب برای اینکه اپلیکیشنی را طراحی کنید و توسعه دهید، الزاماً موفقیت آن اپلیکیشن را به همراه\r\n\r\nندارد. چیزهای بسیار دیگری هم هست که باید به آنها فکر کرد؛ اینکه قرار است چه ارزشی را به مشتری \r\n\r\nارائه کنید؛ مشتریان شما کیستند و چگونه با آنها ارتباط برقرار می کنید و ارزشهای موردنظر خود را به آنها \r\n\r\nعرضه میکنید. فعالیتهای کلیدی و منابع اصلی شما چیستند و همکاران شما چه کسانی هستند؛ و در \r\n\r\nنهایت ساختار هزینه و جریان درآمدی شما چگونه است.\r\n</p>\r\n<b>این کارگاه برای دانشجویانی که در برنامه‌ی Summer of Code شرکت کرده‌اند، رایگان میباشد. اما به دلیل محدودیت ظرفیت پیشنهاد ‌ می‌شود که از طریق سایت ثبت‌نام کنند.</b>','2015-07-24 19:00:00','Site','Workshop',40,100000,'mobile.jpg','image/jpeg',31886,'2015-07-17 09:30:33','2015-07-17 09:30:33','2015-07-17 09:30:33',NULL,0),(65,'همروندی تا بی‌نهایت!','همروندی تا بی‌نهایت!','هزینه‌ی ثبت‌نام: ۱۵۰۰۰ تومان','<p> اساتید: دکتر رامتین خسروی، مهندس احسان خامس‌پناه\r\n</p>\r\n\r\nهمه‌ی ماها با دنیای شیرین برنامه‌سازی آشنایی داریم. دنیایی که در آن برنامه‌ای را طراحی کرده و سپس با کمک زبان‌های برنامه‌سازی رایج اقدام به تولید کدهای اجرایی می‌کنیم. اما شیرینی این دنیا اندک اندک در حال اتمام است! و جریان حاکم بر دنیای برنامه‌های کاربردی به سمت توزیع‌شدگی حداکثری پیش رفته‌اند. در نتیجه، یک برنامه به بخش‌های مختلفی تقسیم می‌شود که هر یک به طور جداگانه در نودهای اجرایی در حال اجرا هستند و مجموع کارکرد تمام نودها در کنار هم هدف‌های برنامه‌سازی را برآورده می‌کنند. اما برنامه‌سازی در دنیایی که اجزای آن توزیع شده هستند و همروندی بالایی دارد خود با چالش‌های متنوعی همراه است و نیازمندی‌های مبتنی بر الزامات توزیع شدگی دارد. در حلقه‌ی «همروندی تا بی‌نهایت» قصد داریم به مقدمات و چالش‌های برنامه‌سازی همروند پرداخته و سپس مدل اکتور را به عنوان یکی از مدل‌های موفق برنامه‌سازی همروند به شکل عمیق‌تر مورد کاوش قرار دهیم..<br>\r\n<b>\r\nظرفیت حلقه محدود است\r\n</b>\r\n','2015-07-24 19:17:00','Site','Ring',15,150000,'Dining_philosophers.png','image/png',1395015,'2015-07-17 14:13:05','2015-07-17 14:13:06','2015-07-19 06:12:39',NULL,0),(66,'کارگاه آموزشی LaTeX','محتوا را از نحوه‌ی نمایش تفکیک کنیم','<p>\r\nاین کلاس به صورت یک کارگاه ۵ ساعته، سه‌شنبه ۲۷ مردادماه ساعت ۱۰ صبح برگزار خواهد شد.\r\n</p>\r\nهزینه‌ی این کلاس ۲۵۰۰۰ تومان است.\r\n</p>','<p>\r\nدونالد کنوث نویسنده کتاب «هنر برنامه نویسی کامپیوتر» است. این کتاب بزرگترین مونوگرافی علمی قرن بیستم شناخته شده. در ابتدا قرار بود که هفت جلد باشد. بعد از چاپ جلد سوم، دونالد می خواست کتابش را ویرایش کند اما متوجه شد که ماشین نویس های قدیم دیگر پشتیبانی نمی شوند، و ساختار کتابش بهم می ریزد.\r\n<br>\r\nاتفاق مشابه آن وقتی از نسخه های قدیمی ورد به نسخه های جدید ورد مهاجرت می کنیم می افتد.\r\n<br>\r\n\r\nدونالد نوشتن کتابش را متوقف کرد و هفت هشت سال به حل این مشکل پرداخت که خروجی آن TeX بود. \r\n</p>','2015-07-24 18:51:00','Site','Workshop',30,250000,'latex.png','image/png',69142,'2015-07-17 19:11:38','2015-07-17 19:11:38','2015-07-20 08:27:03',NULL,0),(68,'How to apply','چرا و چگونه اپلای کنیم؟','<p>\r\n<table>\r\n\r\n<thead>\r\n<tr>\r\n	<th>\r\n	گروه\r\n	</th>\r\n	<th>\r\n	هزینه\r\n	</th>\r\n\r\n</tr>\r\n</thead>\r\n<tbody>\r\n\r\n<tr>\r\n<tr>\r\n	<td>\r\nدانشجویان دانشگاه تهران\r\n	</td>\r\n	<td>\r\n۱۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n<tr>\r\n	<td>\r\nسایر\r\n	</td>\r\n	<td>\r\n۲۵۰۰۰۰ ریال\r\n	</td>\r\n\r\n</tr>\r\n\r\n\r\n</tbody>\r\n\r\n</table>\r\n</p>\r\n<br>','همواره در ذهن افرادی که تصمیم به ادامه‌ی تحصیل در خارج از کشور دارند سوالاتی وجود دارد؟<br>\r\nبه کدام دانشگاه‌ها اپلای کنیم؟<br>\r\nآیا با رزومه‌ی من امکان اپلای وجود دارد؟<br>\r\nچگونه رزومه بنویسیم؟<br>\r\nاپلای کردن برای من مفید است یا خیر؟<br>\r\nو سوالاتی از این قبیل را در همایش «چگونه اپلای کنیم؟» دانش‌جویانی که در بهترین دانشگاه‌های دنیا پذیرش گرفته‌اند پاسخ خواهند داد. هم‌چنین دانشجویانی که چندین سال در بهترین دانشگاه‌ها تحصیل کرده‌اند از تجربیات خود در این باره می‌گویند\r\n<br>\r\n<br>\r\n<p style=\"text-align: center; color: blue;\">\r\n<b>\r\n***دانشجویان دانشگاه تهران \r\n<b style=\"text-align: center; color: red;\">\r\nباید ابتدا از\r\n<a href=\"http://acm.ut.ac.ir/events/auth/register/new\">این لینک\r\n</a>\r\nدر سایت ثبت نام کرده </b>\r\nو سپس\r\nاز طریق \r\n<a href=\"http://acm.ut.ac.ir/events/ut_students/new\" > این لینک </a>\r\n و با استفاده از ایمیل دانشگاهی خود کد تخفیف را دریافت نموده و از همینجا ثبت‌نام نمایید.***\r\n</b>\r\n<br>\r\nدر صورت بروز هرگونه مشکل یا سوال با ایمیل ut.acm.chapter@gmail.com‌ تماس بگیرید.\r\n</p>\r\n<p style=\"text-align:center\" >\r\nپذیرایی به صورت ناهار و میان‌وعده برای شرکت‌کنندگان در نظر گرفته‌شده‌است.\r\n</p>\r\n<br>\r\n<p>افرادی که قادر به شرکت در همایش به صورت حضوری نیستند، می‌توانند از یک‌شنبه برای مشاهده‌ی آنلاین همایش ثبت‌نام کنند. ظرفیت پخش زنده‌ی برنامه محدود است.</p>\r\nاطلاعات تعدادی از سخنرانان همایش در ادامه آمده‌است.\r\n<br>\r\n<p>\r\n<table border=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"LTR\" style=\"text-align:center\"><strong><span dir=\"RTL\">نام</span></strong></p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\" style=\"text-align:center\"><strong><span dir=\"RTL\">دانشگاه پذیرش&zwnj;شده</span></strong></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"LTR\" style=\"text-align:center\"><strong><span dir=\"RTL\">رشته&zwnj;ی تحصیلی</span></strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"RTL\">صبا احمدی</p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\"><a href=\"http://www.umd.edu/\"><em>Maryland</em></a></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"RTL\">ورودی ۸۹ مهندسی کامپیوتر</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"RTL\"><a href=\"http://acm.ut.ac.ir/acm/uploads/post_attachment/attachment/38/MohsenZakeriResume.pdf\">محسن ذاکری</a></p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\"><a href=\"http://www.stonybrook.edu/\"><em>Stony brook</em></a></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"RTL\">ورودی ۹۰ مهندسی کامپیوتر</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"RTL\"><a href=\"http://hamedz.ir/\">حامد زمانی</a></p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\"><a href=\"http://www.umass.edu/\"><em>University of Massachusetts Amherst</em></a></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"RTL\">ورودی ۸۸ مهندسی کامپیوتر- ورودی ۹۲ مهندسی کامپیوتر کارشناسی ارشد</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"RTL\"><a href=\"http://meysam.feghhi.net/\">میثم فقهی</a></p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\"><a href=\"http://ualberta.ca/\"><em>Alberta</em></a></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"RTL\">ورودی ۸۹ مهندسی کامپیوتر دانشگاه تهران</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"RTL\"><a href=\"http://shirianyasaman.webs.com/\">یاسمن شیریان</a></p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\"><a href=\"https://www.stanford.edu/\"><em>Stanford</em></a></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"RTL\">ورودی ۹۰ مهندسی مکانیک دانشگاه تهران</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<p dir=\"RTL\"><a href=\"http://shmardani.net/\">شقایق مردانی</a></p>\r\n			</td>\r\n			<td style=\"width:164px\">\r\n			<p dir=\"LTR\"><a href=\"http://www.ucla.edu/\"><em>UCLA</em></a></p>\r\n			</td>\r\n			<td style=\"width:318px\">\r\n			<p dir=\"RTL\">ورودی ۸۹ مهندسی کامپیوتر دانشگاه تهران</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:110px; width:160px\">\r\n			<p dir=\"RTL\"><a href=\"mailto:sh.taheri@gmail.com\">شمیم طاهری</a></p>\r\n			</td>\r\n			<td style=\"height:110px; width:164px\">\r\n			<p dir=\"LTR\"><em>London Business School, Doctor of Philosophy (PhD), Economics, 2013&nbsp; <br>در حال تحصیل</em></p>\r\n			</td>\r\n			<td style=\"height:110px; width:318px\">\r\n			<p dir=\"LTR\"><span dir=\"RTL\">ورودی 82 کامپیوتر دانشگاه تهران</span></p>\r\n\r\n			<p dir=\"LTR\"><span dir=\"RTL\">ورودی 87 اقتصاد دانشگاه صنعتی شریف</span></p>\r\n\r\n			<p dir=\"LTR\"><strong><em>London School of Economics and Political Science, Master of Science (MSc), Economics(2012 &ndash; 2013)</em></strong></p>\r\n\r\n			<p dir=\"LTR\">&nbsp;</p>\r\n\r\n			<p dir=\"LTR\"><strong></strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:2px; width:160px\">\r\n			<p dir=\"RTL\">علیرضا صادقی</p>\r\n			</td>\r\n			<td style=\"height:2px; width:164px\">\r\n			<p dir=\"LTR\"><em>Maryland, Virginia Polytechnic Institute and State University, Minnesota</em></p>\r\n			</td>\r\n			<td style=\"height:2px; width:318px\">\r\n			<p dir=\"RTL\">ورودی کارشناسی ارشد مهندسی برق-مخابرات 91 دانشگاه تهران</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:2px; width:160px\">\r\n			<p dir=\"RTL\">محمدرضا ایزدی&zwnj;نسب</p>\r\n			</td>\r\n			<td style=\"height:2px; width:164px\">\r\n			<p dir=\"LTR\"><em>Waterloo</em></p>\r\n			</td>\r\n			<td style=\"height:2px; width:318px\">\r\n			<p dir=\"LTR\"><span dir=\"RTL\">ورودی کارشناسی ارشد مهندسی برق-مخابرات 91 دانشگاه تهران</span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:2px; width:160px\">\r\n			<p dir=\"RTL\">الیاس بیاتی</p>\r\n			</td>\r\n			<td style=\"height:2px; width:164px\">\r\n			<p dir=\"LTR\"><em>University of Washington</em></p>\r\n			</td>\r\n			<td style=\"height:2px; width:318px\">\r\n			<p dir=\"LTR\"><span dir=\"RTL\">ورودی ۸۹ مهندسی برق دانشگاه تهران</span></p>\r\n			</td>\r\n		</tr>\r\n\r\n		<tr>\r\n			<td style=\"height:2px; width:160px\">\r\n			<p dir=\"RTL\">آیدا امینی</p>\r\n			</td>\r\n			<td style=\"height:2px; width:164px\">\r\n			<p dir=\"LTR\"><em>University of Washington</em></p>\r\n			</td>\r\n			<td style=\"height:2px; width:318px\">\r\n			<p dir=\"LTR\"><span dir=\"RTL\">ورودی ۸۹ مهندسی کامپیوتر دانشگاه تهران</span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</p>','2015-07-29 04:36:00','Site','Conference',150,250000,'HowToApply-01.png','image/png',326339,'2015-07-20 19:24:29','2015-07-20 14:21:40','2015-07-22 17:36:26',NULL,1);
