INSERT INTO `officerships` VALUES (3,6,1,'','2014-06-12 06:44:13','2014-06-12 06:44:13'),(4,9,10,'','2014-06-12 11:44:34','2014-06-12 11:46:37'),(5,43,12,'\r\n رضایت بالای شرکت‌کنندگان سال‌های قبل و هم‌چنین استقبال دانشجویان دانشگاه‌های دیگر نشان‌دهنده‌ی تسلط مهندس ساده‌دل بر متلب و هم‌چنین آموزش آن است.\r\n وی فارغ‌التحصیل دانشگاه تهران در رشته‌ی مهندسی برق  است .','2014-06-15 03:07:06','2015-06-30 04:33:36'),(6,2,13,'دانشجوی رشته‌ی علوم کامپیوتر دانشگاه امیرکبیر، طراح و توسعه‌دهنده‌ی وب از سال ۱۳۹۰، مسلط به فریمورک Ruby on Rails، مسلط به کتابخانه‌های Backbone.js و Marionette.js، آشنا به فریمورک Ember.js.','2014-06-15 03:18:31','2014-06-15 17:09:57'),(7,3,14,'دانشجوی رشته علوم کامپیوتر دانشگاه امیرکبیر، طراح و توسعه دهنده وب از سال 1388. Drupal contributor و مسلط به فریم‌ورک‌ Laravel.','2014-06-15 03:19:55','2014-06-15 17:29:20'),(8,4,15,'','2014-06-15 03:21:02','2014-06-15 03:21:02'),(9,5,17,'','2014-06-15 03:22:54','2014-06-15 03:22:54'),(10,5,16,'','2014-06-15 03:23:05','2014-06-15 03:23:05'),(11,5,1,'','2014-06-15 03:23:14','2014-06-15 03:23:14'),(12,10,5,'','2014-06-15 03:24:03','2014-06-15 03:24:03'),(13,10,3,'','2014-06-15 03:24:14','2014-06-15 03:24:14'),(15,8,18,'مدرس این حلقه از دانشجویان مهندسی نرم‌افزار دانشکده است که در حال حاضر ویراستاری دو نشریه‌ی معتبر دانشکده یعنی «اف‌یک» و «جریان» را بر عهده دارد.','2014-06-15 03:25:37','2014-09-03 08:08:05'),(16,7,16,'','2014-06-15 03:26:04','2014-06-15 03:26:04'),(17,12,25,'','2014-06-16 03:16:31','2014-06-16 03:16:31'),(18,13,26,'','2014-06-16 03:19:14','2014-06-16 03:19:14'),(19,14,27,'','2014-06-16 03:21:30','2014-06-16 03:21:30'),(20,15,28,'','2014-06-16 03:32:18','2014-06-16 03:32:18'),(21,48,52,'<p>  سوابق برگزاری:  </p>\r\n<p> دانشگاه صنعتی شریف (انجمن علمی دانشجویی) </p>\r\n<p> جمعیت امدادی دانشجویی امام علی (ع) (خانه علم خاکسفید) </p>\r\n<p> آموزش و پرورش منطقه 5 (معلمین دبیرستانهای دخترانه )</p>\r\n <p> دانشگاه پیام نور (واحد پردیس)</p>\r\n<p> موسسه طلوع بی نشانها (سرای امید)</p>\r\n<p>شاخه دانشجویی ACM دانشگاه تهران</p>','2014-06-19 11:38:54','2015-06-30 09:49:13'),(22,20,53,'','2014-06-19 11:53:50','2014-06-19 11:53:50'),(23,18,20,'','2014-06-19 12:19:58','2014-06-19 12:19:58'),(24,19,58,'','2014-06-19 18:47:21','2014-06-19 18:47:21'),(25,22,59,'','2014-06-19 19:06:04','2014-06-19 19:06:04'),(27,24,114,'مدیر فنی پروژه‌ی\r\n<a href=\"http://cafebazaar.ir/\">\r\nکافه‌بازار\r\n</a>\r\nو از بنیان‌گذاران پروژه‌ی\r\n<a href=\"http://divar.ir\">\r\nدیوار\r\n</a>\r\n','2014-07-13 05:51:55','2014-07-13 05:51:55'),(28,23,3,'','2014-08-02 18:07:44','2014-08-02 18:08:12'),(29,23,5,'','2014-08-02 18:07:59','2014-08-02 18:07:59'),(30,30,318,'مربی رشد فردی و تعالی سازمانی با رویکرد Appreciative Coaching \r\n<br>\r\nنویسنده مشترک کتاب Wisdom in Business از انتشارات Palgrave \r\n<br>\r\nمربیگری بیش از ۱۰۰۰ ساعت دوره‌ها و کارگاه‌های رشد فردی و تحول سازمانی \r\n<br>\r\nعضو جامعه‌ی مدرسان بین‌المللی Appreciative Inquiry \r\n<br>\r\nکارشناس برنامه‌ی باشگاه مشاوران اقتصادی رادیو اقتصاد\r\n<br>\r\nکارشناس برنامه‌ی کارآفرینی رادیو گفتگو\r\n<br>\r\n<a href=\"http://www.aparat.com/v/m2Vsb/%D8%A7%D9%85%DB%8C%D8%B1_%D9%85%D9%87%D8%B1%D8%A7%D9%86%DB%8C_%D8%AF%D8%B1_%D8%A8%D8%B1%D9%86%D8%A7%D9%85%D9%87_%D8%AA%D9%84%D9%88%DB%8C%D8%B2%DB%8C%D9%88%D9%86%DB%8C_%DB%B1%2F%DB%B6%DB%B1%DB%B8_%D8%B4%D8%A8%DA%A9%D9%87_%DA%86%D9%87%D8%A7%D8%B1_%D8%B3%DB%8C%D9%85%D8%A7\">کارشناس برنامه‌ی یک کار خوب - پخش بهار ۹۴ </a>\r\n<br>\r\n سايت آقاى مهرانى\r\n<a href=\"http://Thecoach.ir\">Thecoach.ir</a>','2014-11-17 08:26:46','2014-11-17 08:39:51'),(31,33,1,'','2014-12-15 09:16:59','2014-12-15 09:16:59'),(32,39,10,'','2015-02-11 18:30:19','2015-02-11 18:30:19'),(33,40,471,'','2015-02-11 18:54:22','2015-02-11 18:54:22'),(34,45,3,'','2015-06-29 19:48:54','2015-06-29 19:48:54'),(35,1,12,'رضایت بالای شرکت‌کنندگان سال‌های قبل و هم‌چنین استقبال دانشجویان دانشگاه‌های دیگر نشان‌دهنده‌ی تسلط مهندس ساده‌دل بر متلب و هم‌چنین آموزش آن است. وی فارغ‌التحصیل دانشگاه تهران در رشته‌ی مهندسی برق است و','2015-06-29 19:50:24','201